(21, 'lilisapp121@gmail.com', 'Politik dan Kesejahteraan Mahasiswa', 'Pengabdian Masyarakat', '       Alasan saya memilih departmen Politik dan kesejahteraan masyarakat karena saya ingin lebih berperan lagi sebagai penghubung dan pelayanan kebutuhan mahasiswa baik berupa akademik maupun non akademik,selain itu menurut saya,saya juga memiliki komunikasi yang baik sehingga insyaallah saya bisa berkomunikasi dengan baik terhadap lingkungan universitas gunadarma khususnya untuk mahasiswa FIKTI.\r\n\r\nAlasan saya memilih departmen Pengabdian Masyarakat karena saya ingin ikut berperan dalam kegiatan sosial yang diselenggarakan di BEM FIKTI. Saya menyukai kegiatan yang berhubungan sosial masyarakat, saya memiliki jiwa sosial yang tinggi selain itu saya juga suka membantu terhadap sesama.   ', '       Alasan saya mengikuti oprec BEM FIKTI karena saya ingin mengembangkan minat dan bakat saya baik softskill maupun hardskill yang saya miliki di dalam kegiatan yang saya ikuti nanti. Selain itu saya juga ingin memanfaatkan waktu luang saya menjadi hal yang lebih bermanfaat lagi, dengan bergabungnya saya dalam BEM FIKTI semoga saya bisa bermanfaat dan bekerjasama dengan tim.   '),
