(26, 'haroannaulielsadora@gmail.com', 'Penelitian dan Pengembangan', 'Olahraga', ' Saya memilih divisi penelitian dan pengembangan karena Ingin menganalisis suatu masalah atau apapun itu,dan mengembangkan bem fikti supaya lebih maju lagi dalam menjalankna proker selanjutnya. Dan saya memilih pilihan kedua karena saya ingin bergabung langsung di lapangan jika ada event olahraga yang dijalani ', '  Saya ingin belajar serta mengembangkan diri saya dalam berorganisasi,menambah relasi,menambah wawasan,belajar menjadi orang yang bertanggung jawab atas tugas yang telaj diberikan'),
