(31, 'daffa.ghifari20@gmail.com', 'Olahraga', 'Politik dan Kesejahteraan Mahasiswa', ' Alasan saya memilih departemen atau biro olahraga karena saya sedikit lebih memahami bidang olahraga.\r\n\r\n\r\nAlasan saya memilih deprtemen atau biro politik dan kesejahteraan mahasiswa karena saya ingin berpartisipasi dan ingin mempelajari tentang politik dan kesejahteraan mahasiswa.', '  Alasan saya mengikuti BEM karena :\r\n1. Saya ingin mengisi waktu luang saya dengan hal hal positif.\r\n2. Agar saya tidak malas malasan lagi, apabila saya mengikuti BEM saya akan memiliki tanggung jawab di Organisasi.\r\n3. Untuk menambah Pengetahuan dan Pengalaman saya.'),
(32, 'syafiranrzzhr@gmail.com', 'Seni Budaya', 'Pengembangan Sumber Daya Manusia', ' Seni Budaya : Alasan saya memilih biro Seni Budaya karena saya punya ketertarikan dibidang seni khususnya dalam bidang musik. Selain itu saya ingin menambah pengalaman dalam suatu organisasi yang berkaitan dengan Seni.\r\nPSDM : Alasan saya memilih biro PSDM karena saya ingin menambah pengalaman bekerja dengan orang banyak tetapi dalam suasana yang kondusif dan nyaman untuk seluruh staff BEM. ', ' Alasan saya mengikuti BEM adalah untuk memperluas relasi dan mencari pengalaman baru dalam hal berorganisasi. Selain itu saya juga ingin ikut serta dalam semua kegiatan yang akan dibuat oleh BEM.  '),
