(35, 'juansabastian1@gmail.com', 'Media', 'Politik dan Kesejahteraan Mahasiswa', '       Karena saya merasa memiliki kelebihan yang dapat dipergunakan dan dikembangkan dalam departemen atau biro tersebut.   ', '       Karena saya ingin menyalurkan kemampuan dan kelebihan yang saya miliki serta mengembangkannya kedalam aktivitas BEM.   '),
(36, 'robbybaarikly@gmail.com', 'Olahraga', 'Politik dan Kesejahteraan Mahasiswa', 'Untuk pilihan pertama saya memilih biro olahraga karena saya menyukai olahraga,dan saya ingin mengubah perspektif di kalangan mahasiswa untuk olahraga dan mengerti tentang manfaat olahraga bagi kehidupan diri sendiri,ingin memajukan kegiatan olahraga yang ada didalam lingkungan kampus.\r\n\r\ndan untuk pilihan kedua saya memilih biro politik dan kesejahteraan mahasiswa karena saya senang membahas tentang politik dan kesejahteraan,saya ingin belajar lebih dalam lagi tentang politik dan kesejahteraan mahasiswa,ingin terjun langsung ke dalam politik mahasiswa.', '  saya ingin menambah pengalamanlebih di  dalam berorganisasi dan ingin berperan aktif dalam kegiatan mahasiswa,menamabah banyak  skill, seperti komunikasi,menambah jaringan  karena sangat penting juga untuk kehidupan selanjutnya bagi saya.'),
(37, 'renia8547@gmail.com', 'Akademik', 'Pengembangan Sumber Daya Manusia', '            Alasan pilihan 1\r\nKarena saya ingin berkontribusi untuk meningkatkan dan mengembangkan potensi minat dan bakat mahasiswa/i dalam bidang akademis dan menambah wawasan saya dalam bidang teknologi serta meningkatkan potensi softskill saya dalam berkomunikasi baik kepada pihak sponsor maupun mahasiswa/i.\r\n\r\n   Alasan pilihan  2\r\nKarena saya ingin berkontribusi dalam menjaga hubungan kekeluargaan antar pengurus Bem FIKTI.           ', '           Alasan saya \r\nkarena saya ingin menambah wawasan, mengembangkan potensi minat dan bakat serta belajar dari sebuah pengalaman baru.                 '),
(38, 'gitasasmita17@gmail.com', 'Media', 'Bisnis dan Kemitraan', '  ', '  '),
(39, 'fauzanmuhammad0301@gmail.com', 'Administrasi Umum', 'Pengembangan Sumber Daya Manusia', ' saya memilih administrasi umum karena didalam organisasi sebelumnya saya biasa dan sering menduduki posisi ini sehingga saya sudah terbiasa didalam hal administrasi organisasi dan pilihan lain saya yaitu PSDM, alasan saya adalah di biro ini saya bisa mengeluarkan  potensi yang ada didalam diri saya dengan maksimal didalam mengembagkam sdm organisasi yang ada\r\n ', ' saya ingin mengembangkan potensi yang saya miliki dalam berorganisasi dilingkungan kampus khususnya bem dan ingin ikut berkontribusi didalam memajukan bem fikti gunadarma   '),
(40, 'fajrinarridwan@gmail.com', 'Administrasi Umum', 'Pengabdian Masyarakat', '      Ingin mendapatkan pengalaman di bagian administrasi umum dan meningkatkan softkill wilayah masyarakat dan ingin bertemu banyak orang yang menginspirasi dan akan terbangun sebuah relasi.  dan juga saya sudah berpengalaman menjadi sekretaris dan bagian keuangan di organisasai sebelumya, dan saya telah membantu beragam acara penggalangan dana. Ini sangat membantu saya dalam mengatur keuangan', '      Ingin memperluas/menambah wawasan pengetahuan di masyarakat dan belajar berorganisasi, meningkatkan softkill dan hard skill, memerlukan relasi,ingin belajar bekerja sama tim, ingin meningkatkan percaya diri dan Belajar mengatur waktu antara kuliah dan tugas di BEM '),
(42, 'nadiabunga2307@gmail.com', 'Olahraga', 'Pengabdian Masyarakat', '  Pertama karna saya suka dengan hal yang berbau olahraga, membuat saya ikut semangat mengambil peran jika di bagian olahraga walaupun hanya dibalik layar. Selain itu, saya sangat suka ikut berpartisipasi dalam acara sosial membuat saya merasa selalu bersyukur dan senang dapat memberikan kebahagiaan untuk yang lain', '  Ingin ikut serta dalam salah satu organisasi di universitas selain itu juga ingin menambah pengalaman, relasi dan teman dan tentunya ingin mencoba keluar dari zona nyaman saya sendiri'),
(43, 'aldicahyar@gmail.com', 'Olahraga', 'Administrasi Umum', '  Alasan Saya berkeinginan tergabung dalam departemen atau biro tersebut ialah karena Saya tertarik berkontribusi dalam pemberian nilai - nilai dan ketika Saya tergabung dalam departemen atau biro tersebut Saya menjalankan tugas dengan baik, amanah, serta beradaptasi dengan cepat.  ', '  Dengan keikutsertaan Saya dalam BEM, Saya ingin menambah pengalaman dan mengoptimalkan waktu Saya di masa perkuliahan ini. Karena dalam mengikuti BEM Saya mampu bekerja sama dengan orang lain untuk mencapai tujuan bersama dan berusaha dengan rekan - rekan yang lainnya bersama - sama untuk membangun relasi, baik dalam lingkungan internal maupun eksternal.  '),
(44, 'alifm7406@gmail.com', 'Olahraga', 'Seni Budaya', '  Karena ingin meningkatkan atau memajukan bidang olahraga dan seni budaya gunadarma menjadi lebih baik dan untuk mengisi waktu luang mahasiswa/i gunadarma dengan kegiatan positif', '  Untuk meningkatkan soft skill, kemampuan berkomunikasi atau berinteraksi, kerja sama, menambah wawasan, dan meluaskan relasi dan networking'),
(45, 'yudhishadi30@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Administrasi Umum', ' tujuan pilih dept diatas \r\n1. berpartisipasi dalam keberlangsungan bem\r\n2. mengembangkan kemampuan diri\r\n3. menyetarakan kemampuan sumber daya manusia ', '   berpartisipasi dalam pengembangan akademik maupun non akademik mahasiswa, dan meningkatkan kemampuan dalam bekerja sama '),
(46, 'rwiyandru@gmail.com', 'Pengabdian Masyarakat', 'Politik dan Kesejahteraan Mahasiswa', '  Pilihan 1 : Karena saya ingin sekali mewujudkan TRI DHARMA perguruan tinggi yg seharusnya dilakukan mahasiswa demi mendorong kesejahteraan masyarakat sekitar, dan juga saya sangat prihatin terhadap keadaan sosial hari ini\r\n\r\nPilihan 2 : Karena saya ingin politik dikampus berjalan sebagai mana mestinya tanpa ada pembungkaman demokrasi, dan saya ingin menjadi wadah mahasiswa FIKTI untuk menyampaikan aspirasi kepada yang berwenang dikampus', ' Saya ingin mewujudkan BEM FIKTI tidak hanya menjadi roda penggerak dikalangan FIKTI saja, tetapi juga roda penggerak di Univ. Gunadarma (dikarenakan masih lamanya pembentukan BEM Universitas yang wacananya akan terbentuk di tahun 2025)'),
(47, 'Setiawanirfan601@gmail.com', 'Penelitian dan Pengembangan', 'Akademik', ' karena sesuai minat saya ', ' alasan saya mengikuti BEM antara lain yaitu ingin meningkatkan softskill seperti problemsolving, Communication skill, teamwork, dan tentunya analytical & critical thinking. Menambah ilmu dan wawasan dalam kepemimpinan dan juga memperluan relasi/networking. dan yang terakhir yaitu menambah pengalaman saya dalam berorganisasi '),
(49, 'rvmhndr@gmail.com', 'Olahraga', 'Pengabdian Masyarakat', '    Alasan memilih divisi olahraga : Karena saya tertarik dengan dunia olahraga dan ingin mengembangkan hobi saya, dan juga waktu smp saya pernah masuk ke dalam kelas olahraga dan mengikuti banyak lomba seperti futsal, atletik, dan catur. Untuk di esport saya juga lumayan mahir karena pernah sampai rank diamond 1 pada valorant dan mythical glory  pada mobile legend.\r\nSaya ingin ikut serta menyukseskan event-event olahraga yang dilaksanakan oleh departemen olahraga.\r\n\r\nAlasan memilih divisi pengabdian masyarakat : Karena saya tertarik untuk terjun langsung dan berkontribusi di masyarakat, saya juga ingin bermanfaat bagi masyarakat nantinya. Saya juga ingin mencoba hal baru yang menurut saya akan berguna bagi kehidupan saya kedepannya serta ikut mencerdaskan generasi muda seperti yang sudah dilakukan pengurus bem sebelumnya.      ', '    Alasan saya mengikuti bem karena saya ingin membantu dan ikut berpartisipasi pada organisasi bem serta mengabdi untuk masyarakat, fakultas dan universitas. Selain itu saya juga ingin menambah pengalaman berorganisasi dan juga meningkatkan soft skill saya. Menambah relasi, Menyalurkan aspirasi mahasiswa, dan berkomitmen untuk membuat bem fikti lebih baik lagi.  '),
(50, 'adityaiman06@gmail.com', 'Pengembangan Teknologi Informasi', 'Akademik', 'karena saya ingin mempelajarin PTI Dan Akademik ', '  karena saya ingin mengenal lingkungan baru dan belajar bersama'),
(51, 'putrianandashafa@gmail.com', 'Pengabdian Masyarakat', 'Seni Budaya', 'Alasan saya memilih dapertemen pengabdian masyarakat  dan seni budaya tentu saja karna ingin mengasah kemampuan komunikasi, memberi manfaat secara langsung kepada masyarakat, dan memperluas relasi sekaligus menambah wawasan, saya sangat ingin membantu sesama manusia dapartemen pengabdian masyarakat dan seni budaya adalah wadah yang sangat cocok untuk saya. Saya memiliki komunikasi yang bagus, pola pikir yang kritis, manajemen waktu yang baik dan Kooperatif dalam tim, ditambah dengan kemampuan saya dalam menganalisis, mensintesis informasi, dan memeliki rasa ingin tahu yang tinggi. Dengan faktor\" tersebut saya merasa diri saya mampu dan cocok untuk menjadi bagian dari dapartemen pengabdian masyarakat dan seni budaya. \r\n\r\nSelain itu berdasarkan pengamatan saya masih banyak diluaran sana mahasiswa/i yang belum menyadari bakat\" mereka ataupun mereka yang tidak tau harus menyalurkan kemana bakat\" dan ketertarikan yang mereka miliki sehingga hal tersebut membuat saya tergerak untuk membantu mereka agar dapat menggali bakat ataupun ketertarikan yang merka miliki. \r\n\r\nSaya juga ingin berkontribusi langsung dalam pengabdian masyarakat karna faktanya diluaran sana masih banyak orang orang yang mengalami kesulitan dalam pendidikan dan kesehetan terlebih lagi dimasa pandemi dan PPKM yang tak kian berakhir.\r\n ', ' Alasan utama saya ingin bergabung menjadi BEM  adalah karena ingin menjadi bagian langsung dalam proses maju dan berkembangnya BEM FIKTI juga mengasah kemampuan komunikasi dan organisasi, menambah wawasan, meningkatkan soft skill, memperluas relasi  dan networking.\r\nSetelah gagalnya saya dalam proses rekrutmen volunteer heroes yang di adakan pada 2020/2021 kemarin, membuat saya semakin terpacu untuk membuktikan bahwa saya mampu untuk bergabung kedalam BEM FIKTI. Menurut saya BEM akan menjadi sebuah wadah untuk berinteraksi, bersosialisasi dengan mahasiswa lain di FIKTI, terlebih untuk saya yang selalu ingin berkontribusi dalam proses berkembangnya orang lain, saya ingin menjadikan ini sebagai sebuah roda yang akan menjadikan mahasiswanya berpikir cerdas dan kreatif, berpikir kritis dan saling menghargai. '),
(52, 'iqbalnurkholis24@gmail.com', 'Olahraga', 'Penelitian dan Pengembangan', '  Karena saya hobby dalam beberapa olahraga dan mungkin saya bisa ikut serta dalam mengembangkan olahraga di Universitas Gunadarma.', 'Ingin ikut serta dalam membangun Universitas Gunadarma menjadi lebih baik dalam hal organisasi dan memperluas koneksi.'),
(53, 'raihanfaizrahmatullah@gmail.com', 'Pengembangan Teknologi Informasi', 'Penelitian dan Pengembangan', 'karena saya memiliki minat yang sangat tinggi terhadap teknologi dan ingin mengembangkan diri menjadi lebih baik khususnya dalam bidang development program. saya senang menganalisis, menyelesaikan sebuah masalah, dan mencoba hal yang baru. ', 'alasan saya ialah untuk pengembangan diri khususnya dalam bidang organisasi. saya juga ingin berperan aktif dalam kegiatan perkuliahan tidak hanya untuk sekadar pembelajaran akademik tetapi juga untuk ikut serta dalam kegiatan pengembangan mahasiswa dan fakultas.'),
(54, 'fianalaras31@gmail.com', 'Administrasi Umum', 'Administrasi Umum', '    Saya memiliki beberapa pengalaman dalam departemen administrasi umum yakni sebagai sekretaris OSIS ketika SMA dan memiliki pengalaman sebagai bendahara dalam bagian bahasa ketika saya di pesantren. Lebih meningkatkan kemampuan sebagai sekretaris dan bendahara yang telah saya lakukan sejak sekolah khususnya dalam menyusun proposal, LPJ, surat menyurat, dan anggaran dana.', '    1. Pengalaman\r\n       Dengan menjadi salah satu anggota BEM, maka akan semakin bertambahnya pengalaman saya dalam berorganisasi, bekerja sama dengan tim, belajar cara pemosisian diri dengan baik. Bagaimana cara kita dalam menerima berbagai perbedaan pola pikir dan latar belakang, demi terwujudnya visi dan misi BEM, \r\n\r\n2. Meningkatkan softskill\r\nbisa menambah banyak skill, seperti komunikasi, problem solving, manajemen waktu, manajemen emosi, kedewasaan, presentasi, analisis dan berpikir kritis, bekerja sama dengan tim, dan leadership.\r\n\r\n2. Jaringan atau relasi.\r\n     Dengan keterlibatan kita menjadi anggota BEM maka saya akan mempunyai jaringan yang luas dan kuat. Semakin luas diri kita membina hubungan baik dengan berbagai pihak, maka akan memudahkan kita dalam dunia selepas kuliah.\r\n\r\n3. Menambah wawasan \r\n     memperluas wawasan mengenai berbagai hal yang akan mendukung peningkatan kualitas diri kita ke depan.  '),
(55, 'setyawanariel@gmail.com', 'Hubungan Masyarakat', 'Bisnis dan Kemitraan', 'Alasan saya memilih divisi Hubungan Masyarakat karena saya memiliki pengalaman di bidang tersebut khususnya yang berkaitan dengan SEO socialmedia untuk olshop saya dan saya yakin dengan pengalaman tersebut akan membantu saya pada tugas yang akan saya jalani kedepannya, terbukti saya dapat membuat +500 followers baru dalam waktu 3 bulan dengan mengandal SEO.\r\nAlasan saya memilih divisi Bisnis dan kemitraan karena saya memiliki ketertarikan tentang apapun mengenai bisnis, mulai dari membangun relasi, hingga cara mengembangkan bisnis itu sendiri.', ' Alasan saya mengikut BEM adalah untuk membangun relasi dan juga mengembangkan potensi diri saya, karena saya percaya bahwa relasi merupakan hal yang penting di masa depan, terlebih lagi untuk saya yang ingin membangun bisnis '),
(56, 'muhammadae22@gmail.com', 'Olahraga', 'Olahraga', '  Saya lebih tertarik biro tersebut dikarenakan sesuai dengan minat dan kegiatan yang saya lakukan sehari-hari, membuat saya ingin lebih mengembangkan lagi dan menambah kegiatan untuk memajukan dan mewadahi bagi siapa saja pelaku dalam kegiatan tersebut agar menjadi maju', '  Tertarik mencoba berorganisasi, karena banyaknya waktu luang yang saya miliki dan saya ingin menambawah wawasan serta skill untuk bisa jadi apa yang saya inginkan kedepan'),
(57, 'indahalvidesfitri162001@gmail.com', 'Pengabdian Masyarakat', 'Olahraga', '  1. karena saya  ingin mengasah kemampuan komunikasi, memberikan manfaat langsung kepada masyarakat, memperluas jaringan relasi,dan media untuk belajar hal baru. \r\n  2. karena saya ingin belajar berorganisasi,ingin menjadi event organizer, bisa mengukir prestasi dalam bidang tersebut,dan untuk mengembangkan hobi \r\n  ', '  1. saya ingin mempunyai pengalaman \r\n  2. saya ingin mempunyai jaringan relasi pertemanan yang luas \r\n  3. ini kegiatan yang sangat diperhitungkan untuk jangka luas saat bekerja diperusahaan nanti '),
(58, 'reyhansofianthabi@gmail.com', 'Hubungan Masyarakat', 'Administrasi Umum', 'Karena kebetulan minat saya itu khususnya dibidang pelayanan dan adiministrasi. Jadi saya merasa cocok untuk memilih departemen atau biro tersebut. Maka dari itu saya ingin menjadi salah satu bagian dari departemen atau biro tersebut ', 'Saya ingin mengembangkan diri sebaik mungkin dan  saya ingin menambah pengalaman,wawasan dan pengetahuan, ingin meningkatkan percaya diri, memperluas jaringan'),
(59, 'mahfuzhafm374@gmail.com', 'Administrasi Umum', 'Politik dan Kesejahteraan Mahasiswa', 'Memilih department Administrasi Umum pada pilihan pertama adalah karena saya mempunyai minat di bidang tersebut, dan pada organisasi-organisasi sebelumnya, saya pernah berada pada bidang administrasi dan keuangan. Pada pemilihan kedua di department Politik dan Kesejahteraan Mahasiswa alasanya adalah ingin mencari pengalaman baru pada bidang tersebut, serta tertarik mengenai dunia politik.', 'Alasan yang paling utama mengikuti BEM adalah untuk mendapatkan pengalaman tentunya, serta menambah wawasan dan connection, juga sebagai tambahan di CV, untuk melamar pekerjaan ketika sudah lulus dari universitas. '),
(60, 'indahpermatadevi9@gmail.com', 'Administrasi Umum', 'Penelitian dan Pengembangan', 'Alasan saya memilih departemen ini karena saya ingin menambah pengalaman   ', 'Agar saya belajar untuk membagi waktu antara organisasi dan waktu belajar'),
(61, 'christevenjeremys@gmail.com', NULL, NULL, NULL, NULL),
(62, 'adindatricahyani123@gmail.com', 'Bisnis dan Kemitraan', 'Politik dan Kesejahteraan Mahasiswa', 'Pilihan 1 : Alasan saya memilih departemen bisnis adalah untuk lebih belajar dalam strategi kewirausahaan dan bisnis dalam suatu organisasi, menjadikan departemen ini menjadi suatu wadah bagi mahasiswa lain yang tertarik dibidang kewirausahaan agar saling mensupport satu sama lain.\r\nPilihan 2 : Alasan saya memilih departemen politik dan kesejahteraan mahasiswa adalah ingin berkontribusi dalam membangun relasi antar mahasiswa FIKTI serta membangun kepedulian satu sama lain.', '  Alasan saya mengikuti BEM adalah menambah relasi dalam dunia perkuliahan, ingin lebih belajar kerja sama tim, melatih kepercayaan diri, ingin ikut serta dalam membangun BEM FIKTI  yang lebih informatif dan aktif kedepannya.'),
(63, 'ksetiorani@gmail.com', 'Pengabdian Masyarakat', 'Pengembangan Sumber Daya Manusia', 'Alasan saya memilih Departemen Pengabdian Masyarakat (PengMas), karena saya memiliki ketertarikan dan ingin mengembangkan potensi yang saya miliki melalui kegiatan-kegiatan pemberdayaan masyarakat yang kemudian selain memberikan manfaat untuk diri saya sendiri sebagai media pembelajaran, juga dapat bermanfaat untuk orang-orang disekitar saya.\r\n\r\nAlasan saya memilih Biro Pengembangan Sumber Daya Manusia (PSDM), karena saya memiliki ketertarikan untuk belajar bagaimana mengembangkan pengetahuan, keterampilan, dan sikap seseorang. Selain dapat bermanfaat untuk teman-teman lainnnya, hal ini juga dapat bermanfaat untuk diri saya. ', '1. Menambah pengalaman yang saya miliki \r\n2. Menambah relasi \r\n3. Saling bertukar pengetahuan antar anggota bem \r\n4. Dapat memberikan manfaat untuk orang-orang disekitar saya'),
(64, 'virgiekrst@gmail.com', 'Penelitian dan Pengembangan', 'Akademik', 'Alasan saya memilih Biro Penelitian dan Pengembangan ( LitBang ) sebagai pilihan ke -1 karena saya ingin ikut berkontribusi dan menganalisis dengan baik program kerja maupun kegiatan yang akan terlaksana di BEM FIKTI UG nantinya, sesuai dengan visi dan misi yang ada pada BEM FIKTI UG, dan alasan saya memilih Departemen Akademik sebagai pilihan ke -2 karena saya ingin ikut andil dalam mewadahi, mengembangkan, serta mengkoordinasikan minat bakat yang dimiliki mahasiswa FIKTI UG, supaya bisa tersalurkan dengan sebaik - baiknya.', 'Alasan saya ingin menjadi bagian dari  BEM FIKTI UG  karena saya ingin memanfaatkan serta mengembangkan kemampuan yang saya miliki dalam berorganisasi, dan ikut berpartisipasi dalam mengembangkan program kerja maupun kegiatan - kegiatan yang akan terlaksana di BEM FIKTI UG kedepannya.'),
