(66, 'zaidan2402@gmail.com', 'Hubungan Masyarakat', 'Olahraga', '    Melatih skill saya dan mempermbangkan hobi saya, saya ingin belajar agar berpikir lebih kritis, saya ingin belajar membagi waktu dengan baik agar terlatih.\r\n  ', '    Saya ingin mendapatkan pengalaman yang banyak saat masih di perkuliahan dan ingin belajar bertanggung jawab saat menjadi anggota bem.  '),
(67, 'Malikiawanda4@gmail.com', NULL, NULL, NULL, NULL),
(68, 'priscillaehaumahu@gmail.com', 'Administrasi Umum', 'Seni Budaya', ' Saya memilih departemen atau biro bidang administrasi umum sebagai pilihan pertama saya karena saya sudah pernah berdinamika dibagian tersebut dan selama saya berdinamika dibagian tersebut saya menikmati setiap prosesnya sehingga saya menyukai jobdesk terutama pada bidang kesekretariatan.\r\n Saya memilih departemen atau biro bidang seni budaya sebagai pilihan kedua saya karena saya sendiri memang senang dalam bidang seni budaya terutama pada musik, saya ingin mahasiswa Gunadarma yang mempunyai ketertarikan terhadap seni budaya ini mempunyai wadah untuk mengembangkan bakatnya.', 'Saya mengikuti BEM karena memang dari kecil saya sudah senang berorganisasi. Karena organisasi juga saya banyak belajar berbagai hal seperti jobdesk setiap bidang, jalur birokrasi yang benar, mengerti cara memanage waktu yang baik dan benar, dan masih banyak lagi. Dengan mengikuti BEM juga saya ingin menambah ilmu berorganisasi saya dan saya juga ingin menggunakan dan membagi ilmu berorganisasi yang saya bisa didalam BEM agar bisa bertumbuh bersama.'),
(69, 'iqbalaarafura@gmail.com', 'Olahraga', 'Pengabdian Masyarakat', '  Alasan saya memilih departemen olahraga karena saya penasaran di departemen olahraga itu selain mengurusi tentang acara FEX dan OGUN itu ngapain aja si, karena selama saya menjadi Volunteer FEX, anggota departemen olahraga selalu bekerja di belakang layar tanpa diketahui oleh volunteer nya. Kalau alasan saya memilih departemen PengMas itu karena saya ingin menambah pengalaman tentang perbuatan sosial membantu sesama di situasi pandemi ini', 'Ingin menambah relasi dan ingin menambah kesibukan selama kuliah '),
(70, 'panduv2000@gmail.com', 'Olahraga', 'Olahraga', '  karena saya merupakan pemain sepakbola di klub selama 8 tahun dan pemain tim futsal dari SD hingga SMA. Pernah menjabat sebagai koordinator perlombaan di CUP sekolah SMA tingkat region. ', '  menambah pengalaman, relasi, dan softskill lainnya. juga berusaha memberikan skill yang saya punya untuk bermanfaat bagi organisasi. '),
(71, 'rezaeka490@gmail.com', NULL, NULL, NULL, NULL),
(72, 'anandasatriaf6@gmail.com', 'Olahraga', 'Penelitian dan Pengembangan', ' Bidang Olahraga: Memiliki minat yang kuat di bidang Olahraga, Suka mengikuti perkembangan olahraga di dunia maupun nasional dan merupakan memiliki salah satu passion/hobi di bidang olahraga. Serta ingin mengetahui lebih dalam mengenai pengurusan olahraga yang ada di lingkup FIKTI maupun kampus, ingin bisa menjadi salah satu anggota kepanitiaan event-event olahraga yang diadakan BEM FIKTI, memiliki keinginan meningkatkan potensi SDM yang berprestasi di bidang olahraga FIKTI khususnya.\r\n\r\nBiro Penelitian dan Pengembangan: Memiliki minat untuk mengolah dan menganalisis suatu data, Ingin mengetahui mengenai pelaksanaan penelitian di lingkup organisasi, ingin mengembangkan kemampuan analisis, ingin bisa melakukan pengembangan dari memperoleh suatu data menjadi informasi yang bermanfaat untuk perkembangan atau keberhasilan program kerja BEM FIKTI, Ingin mengasah kemampuan untuk memcahkan suatu masalah.', '   1. Ingin mendedikasikan diri di sebuah organisasi dengan lingkup yang lebih besar di Universitas\r\n2. Ingin menambah lingkup relasi/jaringan pertemanan yang lebih besar\r\n3. Ingin bisa bekerjasama dan meningkatkan rasa kerja sama di sebuah kelompok atau tim\r\n4. Ingin mempunyai pengalaman di sebuah organisasi untuk bekal di dunia pekerjaan maupun lingkungan sekitar\r\n5. Sebuah nilai plus untuk sebuah perusahaan jika melamar/mendapatkan pekerjaan di luar sana nantinya\r\n6. Menjadi sebuah jembatan antara mahasiswa dengan pihak kampus   '),
(73, 'hani.khairunnisa02@gmail.com', NULL, NULL, NULL, NULL),
(74, 'rikam881@gmail.com', 'Politik dan Kesejahteraan Mahasiswa', 'Pengabdian Masyarakat', 'Sesungguhnya, tidak ada alasan yang diungkapkan untuk saya memilih mengikuti kegiatan kesejahteraan mahasiswa atau pengabdian masyarakat, karena mengikuti kegiatan seperti pengabdian tersebut, menurut saya memanglah kewajiban kita sebagai mahasiswa. Rasa itu ada ketika hati telah bergerak, kesempatan ada, dan adanya motivasi serta inpirasi.', ' Belajar berorganisasi, meningkatkan soft skill, menambah banyak wawasan dan pengetahuan, bisa bekerja sama tim, menambah pengalaman.'),
(75, 'shafiraima13@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Pengabdian Masyarakat', '     Alasan saya memilih  di departemen itu untuk menggali, mengoptimalkan, dan membina setiap potensi yang dimiliki khususnya dalam hal manajerial, organisasi, dan softskill untuk mewujudkan generasi-generasi yang lebih baik di masa mendatang. \r\n  \r\nDan harapan saya ketika tergabung departemen itu adalah dapat memperluas jaringan pertemanan dan menambah keluarga baru,Dan jika saya terpilih untuk menjadi staff di departemen ini saya sangat berharap dapat memahami hal-hal yang sebelumnya tidak saya pahami, serta saya berharap dapat belajar hal baru mengenai pengadaan acara berskala besar ,saya berharap dapat menjalankan tugas-tugas dengan baik dan menjaga hubungan antar anggota ,serta dapat memelajari hal-hal baru lain yang sebelumnya belum pernah saya dapatkan.\r\n\r\n ', '    Alasan saya sangat berantusias mengikuti bem karna saya ingin menambah pengalaman saya yang nantinya akan menjadi bekal untuk masa depan saya,selain itu saya ingin  meningkatkan soft skill saya,karna soft skill  merupakan faktor yang sangat diperhatikan untuk bekal nanti nya di sebuah perusahaan .lalu alasan selanjutnya adalah belajar manajemen , melalui bem disana kita akan belajar mengolah diri kita dan kegiatan- kegiatan yang ada di dalam nya. serta belajar memanajemen waktu walaupun kita mempunyai amanah dalam organisasi ini akan tetepi kita tidak boleh melupakan amanah utama kita yaitu menuntut ilmu.alasan selanjutnya adalah untuk menambah relasi dan networking serta menambah wawasan,pastinya semakin banyak relasi dan networking kita akan bertemu dengan orang orang yang memiliki pengalaman yang berbeda- beda dan tentunya kita dapat mengambil pelajaran pelajaran dalam pengalaman mereka.dan Semakin luas  membina hubungan baik dengan berbagai pihak, maka akan memudahkan dalam dunia setelah kuliah.\r\n'),
(76, 'abikzai205@gmail.com', 'Politik dan Kesejahteraan Mahasiswa', 'Politik dan Kesejahteraan Mahasiswa', ' Karena menurut saya departemen tersebut sesuai dengan minat saya di bidang politik. ', '1. Ingin menambah wawasan\r\n2. Ingin menambah pengalaman\r\n3. Memperluas jaringan pertemanan\r\n4. Silaturahmi\r\n5. menambah rezeki '),
(77, 'vanisaauliaputriyani@gmail.com', 'Seni Budaya', 'Akademik', 'Pilihan 1: \r\nAlasan saya memilih departemen Seni Budaya di dalam pilihan 1 karena ketika saya berkontribusi sebagai volunteer di dalam acara Fikti Art Festival 3.0, sebuah acara yang dilakukan oleh BEM FIKTI khususnya di dalam Departemen Seni Budaya, saya melihat bagaimana semua anggota BEM FIKTI dari Departemen Seni Budaya bertanggung jawab dalam jabatannya masing-masing, selalu berdiskusi untuk menyelesaikan sebuah masalah atau hambatan yang ada, dan juga cara mengayomi para volunteer dengan sabar dan baik. Hal itu membuat saya terkesan sehingga memunculkan rasa ketertarikan saya untuk masuk ke dalam departemen ini. Juga, karena dengan adanya pengalaman dibidang ini, saya ingin mengembangkan diri lebih luas lagi dan bisa berkontribusi lebih banyak di berbagai acara, projek ataupun kegiatan yang ada di dalam departemen ini. \r\n\r\nPilihan 2: \r\nAlasan saya memilih departmen akademik di pilihan ke 2 karena ini adalah hal baru bagi saya, saya belum pernah mempunyai pengalaman di dalam bidang ini. Sehingga, saya sangat tertarik untuk belajar hal baru dan mengembangkan diri di dalam departemen ini, terlebih lagi kemampuan retorika saya akan lebih terasah karena bisa dikatakan bahwa kemampuan komunikasi disini menjadi salah satu kunci kesuksesan untuk membuat suatu acara dapat terlaksana. Juga, saya sangat tertarik untuk membuat inovasi-inovasi baru dan mengembangkan lebih luas lagi konsep yang ada di dalam departemen akademik ini. Serta, saya juga ingin membantu teman-teman mahasiswa untuk meningkatkan potensi diri mereka khusunya di bidang akademik. \r\n', 'Alasan utama mengikuti BEM Fakultas ini adalah saya ingin mendapatkan banyak pengalaman dalam berorganisasi. Namun, selain alasan utama tersebut ada beberapa faktor lain yang mendorong saya untuk mengikuti organisasi ini yaitu saya ingin mengetahui bagaimana sudut pandang orang lain ketika sedang berdiskusi untuk mencasi solusi terkait sebuah projek/kegiatan, sebuah isu yang ada, ataupun sebuah masalah. Dimana agar saya dapat mengetahui sudut pandang orang lain tersebut, saya harus bertemu dengan banyak orang, karena BEM ini adalah sebuah wadah yang berisikan banyak anggota yang nantinya pasti akan melakukan banyak diskusi dan bertukar pikiran inilah saya memutuskan untuk mengikuti organisasi ini. Faktor lainnya, saya juga ingin mengembangkan dan mengasah lebih tajam lagi skill-skill yang saya miliki, khususnya soft skill. Dimana soft skill ini akan berkembang jika saya terjun langsung ke dalam sebuah kegiatan atau acara, dan di dalam BEM Fakultas ini juga menyediakan banyak rangkaian acara yang nantinya bisa saya lakukan atau kerjakan. \r\n'),
(78, 'marsyaandhistaaa@gmail.com', NULL, NULL, NULL, NULL),
(79, 'sefa.febrian@gmail.com', 'Seni Budaya', 'Pengembangan Sumber Daya Manusia', '   Seni budaya : saya sangat menyukai bidang seni dan memiliki kemampuan dalam seni seperti bernyanyi dan pentas drama. Dengan kemampuan yang saya miliki saya yakin bahwa saya dapat menampung aspirasi dari mahasiswa dan menjadi wadah agar bakat minat para mahasiswa yang memiliki jiwa seni dapat tersalurkan.\r\n\r\nPSDM : saya memilih departemen PSDM karena saya ingin mengembangkan potensi sesama anggota serta mengoptimalkan organisasi menjadi lebih baik agar meraih tujuan bersama. Alasan lain Saya memilih PSDM karena saya ingin meningkatkan kemampuan dalam berelasi dan fokus dalam keorganisasian ', ' Alasan saya ingin mengikuti BEM karena saya ingin meningkatkan skill dalam berorganisasi dengan menyelesaikan suatu masalah secara bersama dan mencapai tujuan yang sama. Selain itu saya juga ingin memperluas wawasan saya mengenai leadership karena dalam kegiatan BEM kami akan mengenal mengenai hal tersebut yang nantinya akan berguna baik dalam dunia perkuliahan maupun pada dunia pekerjaan. Alasan terakhir saya ingin mengikuti BEM karena saya ingin berfikir kritis dan analitis, saya ingin memperkuat hal tersebut karena seperti yang sudah diketahui mahasiswa hatus berfikir kritis dan analitis. Melalui BEM saya yakin saya bisa mengasah beberapa keterampilan seperti yang sudah saya sebutkan. '),
(80, 'abiyyahbilazahra@gmail.com', 'Akademik', 'Pengabdian Masyarakat', '  1. Alasan saya mengambil departemen Akademik karena saya pernah ikut serta dalam program kerja dari departemen akademik, yaitu TechnoFair jadi setidaknya saya sedikit paham akan kegiatan apa saja yang ada disana dan juga alasan yang lainnya adalah saya berharap jika saya masuk di departemen tersebut, banyak ilmu akademik yang bertambah\r\n2. Alasan saya mengambil departemen Pengabdian Masyarakat pastinya saya ingin mengabdi kepada masyarakat dengan membantu masyarakat didaerah tertentu dalam bentuk finansial maupun pendidikan dan alasan lainya adalah saya ingin merasakan rasanya berbagi kepada orang yang kondisi nya menengah kebawah. Walaupun bisa dilakukan diluar bem, saya mau mengawali itu di bem fikti', '  Alasan saya mengikuti BEM, yaitu untuk menambah wawasan, menambah relasi, melengkapi cv kedepannya. Kemudian, alasan saya yang lebih spesifik mengikuti bem adalah untuk medapatkan benefit-benefit lainnya seperti public speaking, bekerja sama dalam tim, lebih mengatur waktu antara bem dengan kuliah dan lainnya'),
(81, 'nwulandari155@gmail.com', 'Administrasi Umum', 'Pengabdian Masyarakat', ' Pilihan pertama saya adalah Administrasi Umum, alasannya karena saya memiliki pengalaman mengikuti kegiatan organisasi sebelumnya yaitu ekstrakurikuler olahraga dan menjabat sebagai bendahara selama 2 periode dan saat ini saya menjabat sebagai sekretaris di kepemudaan rt di lingkungan rumah saya. Alasan lainnya pula saya ingin mendalami  tata cara yang benar dalam penyusunan proposal, lpj dan anggaran dana ditingkat yang lebih tinggi yaitu BEM.\r\n\r\nPilihan kedua saya adalah pengabdian masyarakat, alasan saya memilih ini karena saya sangat ingin terjun langsung kepada masyarakat untuk membantu dan menyadarkan akan kepekaan sosial seperti bansos dan sosialisai. ', ' Saya ingin berpartisipasi dan menjadi bagian dari kemajuan BEM serta menambah pengetahuan dan skil saya '),
(82, 'andreprat44@gmail.com', 'Pengabdian Masyarakat', 'Hubungan Masyarakat', '  karena saya merasa memiliki kemampuan untuk berada di departemen atau di biro tersebut. kemudian juga saya ingin mengasah skill saya di bagian sosial dan masyarakat', '  karena ingin memperluas jaringan relasi dan juga ingin mengasah skill keorganisasian khususnya di lingkungan kampus yaitu badan eksekutif mahasiswa atau BEM'),
(83, 'alfred.andolin12@gmail.com', NULL, NULL, NULL, NULL),
(84, 'dhaniae27@gmail.com', 'Pengabdian Masyarakat', 'Seni Budaya', '  Alasan saya memilih divisi Pengabdian Masyarakat (PengMas) adalah karena sebagai masyarakat yang terpelajar kita tidak boleh melupakan kewajiban untuk berkontribusi langsung kepada masyarakat dan melalui divisi ini, saya berniat untuk mengadakan kegiatan sosial yang lebih menarik dan menghibur.\r\n\r\nAlasan saya memilih divisi seni budaya karena seni budaya adalah bidang yang menurut saya relevan dengan hal yang saya sukai. Saya memiliki ketertarikan dalam bidang seni terutama seni musik. Pada jenjang SMA, saya tergabung dalam paduan suara sekolah dan menurut saya, bekerja dalam bidang divisi yang sejalan dengan apa yang menjadi ketertarikan saya juga dapat menjadi wadah bagi saya untuk terus belajar atau mendalami bidang tersebut.   ', ' Alasan saya mengikuti BEM (Badan Eksekutif Mahasiswa) yaitu ingin belajar dan memiliki pengalaman berorganisasi yang lebih baik dikarenakan organisasi merupakan tempat berkumpulnya individu yang bekerja sama demi tujuan yang sama, meningkatkan soft skill terutama dalam kepemimpinan dan berpikir kritis, membantu saya dalam menambah wawasan dengan memperbanyak pengalaman berinteraksi dengan orang banyak, memperluas relasi, serta menambah nilai jual Curriculum Vitae (CV). '),
(85, 'angelaaprr9@gmail.com', 'Pengabdian Masyarakat', 'Administrasi Umum', ' Saya sangat menyukai hal hal yang berhubungan dengan berinteraksi dengan masyarakat sekitar ', ' Ingin meningkatkan softskill yang ada pada diri sendiri,ingin menambah banyak wawasan dengan semakin banyak berinteraksi dengan berbagai macam orang '),
(86, 'hendritri19@gmail.com', 'Media', 'Olahraga', 'Memiliki pengalaman di bidang dokumentasi serta paham tentang dunia entertaint. seperti kamera, drone dan editing. oleh karena itu saya sangat ingin mengaplikasikan kemampuan saya di bidang yang sudah saya pilih.', '  ingin mengetahui, mempelajari serta mengikuti serangkaian kegiatan kampus. serta upgrade diri untuk menjadi lebih baik lagi dalam bidang organisasi kampus.'),
(87, 'syafiqhilmy620@gmail.com', 'Hubungan Masyarakat', 'Pengembangan Sumber Daya Manusia', '  karena saya ingin medapatkan relasi baru dan ingin mendapatkan pengalaman baru di departemen tersebut ', '  karena ingin mendapatkan relasi baru dan mendapatkan pengalaman berorganisasi '),
(88, 'wildanali4321@gmail.com', NULL, NULL, NULL, NULL),
(90, 'fadhianrsy19@gmail.com', 'Pengabdian Masyarakat', 'Penelitian dan Pengembangan', 'Alasan saya memilih departemen pengmas:\r\n1. Saya memiliki passion dan senang dalam mengikuti seluruh kegiatan sosial untuk membantu aktivitas masyarakat tanpa mengharapkan imbalan, baik dari lingkungan kampus maupun masyarakat. Sebab itu, saat ini saya juga aktif mengikuti kegiatan sosial di masyarakat tempat saya, yaitu karang taruna. \r\n2. Ingin berkontribusi menyalurkan jiwa kepedulian dan kepekaan terhadap masyarakat luas.\r\n3. Pengmas bisa menjadi wadah dalam membentuk karakter dan pengembangan diri saya untuk menjadi lebih baik.\r\n4. Mengasah skill public speaking dalam kegiatan sosial.\r\n\r\nAlasan saya memilih departemen litbang:\r\n1. Senang dan berminat dalam melakukan penelitian atau mengkaji banyak hal.\r\n2. Meningkatkan skill meneliti dan menyelesaikan masalah secara bersama-sama tanpa menjatuhkan pihak manapun.\r\n3. Mengasah kemampuan berfikir kritis dan teliti.\r\n4. Belajar dan meningkatkan kemampuan mengambil keputusan dengan resiko yang sudah dipikirkan dan sudah melakukan riset.', 'Alasan saya mengikuti BEM FIKTI, menurut saya:\r\n1. BEM FIKTI merupakan organisasi yang penting dan wajib saya ikuti untuk pengembangan diri saya dalam berinteraksi, bersosialisasi, dan berkolaborasi dengan orang lain baik antar teman,anggota, dan kakak tingkat.\r\n2. Menambah pengalaman wawasan baru di dalam hidup saya dimana belum pernah saya dapatkan dimanapun dan belajar tentang bekerja sama untuk mencapai satu tujuan yang sama dimana nanti ilmu tersebut pasti berguna untuk karir saya setelah lulus dari perkuliahan.\r\n3. Melatih dan meningkatkan skill kepemimpinan, komunikasi dengan baik, kerja sama, manajemen waktu, dan cara menyelesaikan masalah.\r\n4. Memperluas relasi dan networking, dimana saya akan membina hubungan dengan berbagai pihak sehingga bisa menjadi benefit untuk karir saya dimasa depan.\r\n5. Ingin menyuarakan atau berkontribusi dalam meningkatkan kualitas BEM FIKTI sehingga dapat membangun hubungan harmonis untuk masyarakat FIKTI.\r\n  '),
(91, 'yazidamirullah05@gmail.com', 'Administrasi Umum', 'Bisnis dan Kemitraan', ' - Saya terbiasa dalam surat menyurat dan seringkali menjadi sekretaris dalam kegiatan apapun jadi saya memilih divisi administrasi umum. \r\n- Bisnis dan kemitraan saya suka dengan dunia bisnis jadi saya ingin mengambil banyak pengalaman dan wawasan bisnis dan kemitraan di BEM ini. ', '   Menambah wawasan saya tentang keorganisasian dan memperbanyak jaringan. '),
(92, 'ghassanirr27@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Pengabdian Masyarakat', 'karena saya merasa percaya diri dalam bersosialisasi dengan orang baru selain itu saya mudah beradaptasi dengan lingkungan yang baru, saya merasa memiliki jiwa sosial yang tinggi dan peduli terhadap sesama sehingga saya yakin dapat bertanggung jawab atas tugas-tugas yang nantinya saya akan jalani.', 'karena saya ingin menambah relasi antar individu dan  ingin mencari pengalaman dalam organisai dalam bidang yang saya minati '),
(93, 'andrewfredinando77@gmail.com', 'Hubungan Masyarakat', 'Pengembangan Sumber Daya Manusia', '  Karena menurut saya, saya ahli dalam bidang tersebut dan ingin sama sama belajar untuk memperdalam ilmu di bidang tersebut sehingga memperoleh hasil yang terbaik untuk diri sendiri maupun untuk sesama.', 'Saya ingin memperluas relasi di kampus dan ingin aktif di dalam sebuah organisasi untuk menambah teman dan channel ketika saya lulus nanti.'),
(94, 'ayuandi517@gmail.com', 'Seni Budaya', 'Olahraga', ' Alasan saya memilih departemen Seni Budaya karena saya sangat menyukai musik dan bisa menari juga, jadi saya sangat tertarik untuk terus mencari informasi lebih banyak tentang dunia seni budaya, ingin lebih mengembangkan kebudayaan Indonesia dan ingin mencari relasi dengan orang yang sama-sama menyukai/ahli di bidang musik dan menari.\r\nAlasan saya memilih departemen Olahraga, salah satunya karena saya menyukai basket dan bisa voli jadi saya ingin terus mengasah kemampuan saya di bidang olahraga supaya saya bisa lebih sehat dan segar, lalu bisa dapat banyak pengalaman, dan bertemu dengan orang-orang yang menyukai/ahli di bidang olahraga.  ', ' Alasan saya mengikuti BEM karena saya ingin bisa ikut berkontribusi langsung pada setiap kegiatan/acara di fakultas khususnya FIKTI, bisa menambah hal-hal/ilmu baru, bisa lebih mengajarkan saya cara untuk bersosialisasi dengan baik dan mampu bekerja secara tim, bisa lebih kuat dan yakin untuk berkomitmen pada suatu hal, dan ingin bisa memperluas relasi yang sesuai di bidang yang saya minati. '),
(95, 'dimas19.bagus@gmail.com', 'Pengabdian Masyarakat', 'Akademik', 'Alasan saya memilih departemen pengabdian masyarakat dan akademik adalah ingin menjadi bagian dan berperan serta dalam kegiatan - kegiatan sosial yang diadakan oleh BEM FIKTI serta melatih dan meningkatkan kepedulian saya terhadap lingkungan dimana saya berada. ', 'Alasan saya mengikuti BEM saya ingin berkontribusi dalam kegiatan organisasi khususnya BEM FIKTI Universitas Gunadarma serta melatih diri saya untuk menjadi pribadi yang lebih baik dengan mengikuti dan memiliki pengalaman dalam berorganisasi.'),
(96, 'fioreza1902@gmail.com', 'Bisnis dan Kemitraan', 'Pengabdian Masyarakat', ' Alasan saya memilih bismit karena selain bismit selaras dengan minat saya, saya juga memiliki pengalaman dibidang bisnis yang diharapkan bisa mengembangkan biro tersebut. Selain itu saya juga ingin meningkatkan kemampuan saya sebagai entrepreneur. Lalu untuk alasan pilihan kedua karena pengabdian masyarakat memiliki proker untuk membantu masyarakat sekitar (adanya bencana, anak anak, dll) sehingga saya ingin mencoba bersama teman - teman khususnya BEM FIKTI untuk lebih peka terhadap masalah sosial di lingkungan sekitar. Serta dengan bergabungnya saya di biro ini saya akan melihat serta mencoba hal baru di setiap harinya.', '       karena saya ingin menambah wawasan dan pengetahuan, belajar bekerja secara team, Menambah pengalaman, Memperbanyak relasi dan networking, meningkatkan rasa percaya diri, dan saya ingin berkontribusi lebih kepada fakultas saya.     '),
(97, 'sulthondaffakautsar@gmail.com', 'Penelitian dan Pengembangan', 'Akademik', '  ', '  '),
(98, 'aprilintnkh@gmail.com', 'Pengabdian Masyarakat', 'Olahraga', ' Alasan saya memilih departemen pengabdian masyarakat karena saya ingin membantu masyarakat di sekitar yang kurang dari segi apaupn, terlebih lagi pada anak usia dini yang kurang ada nya pendidikan, maka dari itu dengan saya memilih departeemn pengabdian masyrakat ini dapat membuat saya memiliki rasa kepedulian yang lebih dan menghargai kepada masyarakat sekitar.\r\n\r\nAlasan kedua saya memilih departemen olahraga karena saya ingin meningkatkan minat olahraga mahasiswa gunadarma.', '  Alasan saya Ikut BEM untuk melatih diri saya agar mudah bersosialisasi dengan orang-orang baru di organisasi tersebut, dan melatih pola pikir saya untuk berfikir lebih luas dalam menjalankan atau menyusun sebuah organisasi denag baik. '),
(99, 'arifatah.zaka@gmail.com', 'Hubungan Masyarakat', 'Penelitian dan Pengembangan', 'yang pertama saya memilih di biro hubungan masyarakat karena saya memiliki ketertarikan terhadap bidang publikasi dan hubungan antar internal maupun eksternal, saya juga ingin menyuarakan pendapat - pendapat saya beserta BEM FIKTI melalui media sosial ataupun dengan media lainnya. karena menurut saya informasi adalah suatu hal yang penting dan berperan penting dalam keberlangsungan suatu organisasi. \r\n\r\nkemudian yang kedua saya memilih biro penelitian dan pengembangan saya tertarik untuk terjun lebih dalam untuk memanage suatu program kerja, maupun membuat suatu yang dapat meningkatkan kinerja serta memunculkan ide - ide untuk membuat suatu gebrakan baru yang dapat menciptakan impact yang lebih pada suatu kegiatan atau program kerja yang ada di BEM FIKTI. selain itu saya juga ingin berlatih untuk berfikir rasional terhadap suatu masalah yang ada di sekitar.', '  alasan saya mengikuti BEM adalah saya ingin mengembangkan potensi yang ada di dalam diri saya melalui organisasi BEM, saya juga ingin memperluas wawasan serta relasi yang dapat didapatkan melalui organisasi BEM. Selain itu saya juga ingin berkontribusi penuh untuk memberikan peran saya untuk kemajuan BEM FIKTI supaya terus berkembang dan menciptakan inovasi - inovasi baru yang berbeda dari yang lainnya.'),
(100, 'aifero.muhammad20@gmail.com', 'Penelitian dan Pengembangan', 'Olahraga', 'Saya memilih Biro Penelitian dan Pengembangan karena saya sendiri memiliki passion dibidang data. Saya yakin divisi ini merupakan posisi yang paling tepat untuk mengaplikasikan dan mengembangkan minat kerja saya. Karena juga sejalan dengan karir yang saya inginkan di masa depan yaitu sebagai data analist sehingga Saya sangat berharap Saya dapat memperluas pengetahuan dan kemampuan saya disini.', 'Saya ingin memberikan kemampuan saya untuk ikut berjuang menjadi jembatan antara mahasiswa dengan pihak kampus dalam menyuarakan pendapatnya serta menjadi wadah dalam meningkatkan kualitas SDM mahasiswa kampus. Saya juga ingin ikut memberikan ide dan berkontribusi dalam menyukseskan program kerja yang dimiliki oleh organisasi dengan semua kemampuan yang bisa saya berikan. Memaksimalkan waktu dan kesempatan dalam mengembangkan pengetahuan berorganisasi, menambah soft skill, dan relasi sehingga menjadi nilai plus bagi diri saya sendiri dan memiliki dampak yang baik bagi orang lain.'),
(101, 'cut.nailaff@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Pengabdian Masyarakat', ' Biro Pengembangan Sumber Daya Manusia: saya tertarik akan proker dari biro psdm yang tertera pada web bem fikti dan saya ingin menjadi bagian dari biro psdm untuk membangun hubungan antar pengurus bem yang harmonis dan positif.\r\n\r\nDepartemen Pengabdian Masyarakat: saya merasa senang ketika dapat membantu sesama, seperti membantu korban bencana alam, menyebarkan awareness terkait isu sosial, dll. saya harap dengan gabungnya saya pada departemen ini, saya dapat membantu lebih banyak orang lagi.', '    Saya menyadari bahwa BEM memiliki peran penting dalam pengembangan diri, dimana saya dapat belajar berproses, memperluas relasi, dan juga mengasah skill.  '),
(102, 'bimopraksw@gmail.com', NULL, NULL, NULL, NULL),
(103, 'febyanaji16@gmail.com', 'Olahraga', 'Olahraga', 'Menambah pengalaman dalam mengurus kepanitiaan acara olahraga dan bakat minat olahraga', '    Supaya menambah pengalaman berorganisasi dan untuk menambah wawasan serta menambah relasi  ');
INSERT INTO `users_choose_point` (`id_point`, `email`, `choose_one`, `choose_two`, `reason`, `motivations`) VALUES
(104, 'aprasista178@gmail.com', 'Pengabdian Masyarakat', 'Pengabdian Masyarakat', ' Saya punya background yang relevan,saya sudah mempunyai pengalaman sebagai volunteer di acara HEROES VII untuk  divisi sponsorship, saya pernah mengalami tantangannya, saya pernah membuat inisiatif disana, maka hal tersebut akan sangat sangat membantu saya dalam berkomunikasi/ berinteraksi dengan rekan kerja saya nantinya ', 'Saya melihat BEM FIKTI ini memiliki visi dan misi yang salah satunya bertujuan untuk meningkatkan kualitas SDM mahasiswa sehingga dapat bermanfaat untuk masyarakat luas. Dan telah berlangsung dalam trend yang positif, sehingga saya secara pribadi sangat ingin menjadi bagian dari organisasi ini supaya dapat berkontribusi langsung dan dapat bertumbuh serta mengembangkan talenta saya secara profesional dan memberikan kontribusi positif bagi organisasi\r\n\r\n'),
(105, 'david_wawarag@yahoo.com', 'Politik dan Kesejahteraan Mahasiswa', 'Seni Budaya', 'Politik dan Kesejahteraan Mahasiswa karena berharap memiliki kemungkinan untuk ikut campur dengan sistem yang ada di dalam internal kampus, karena agak kesal dengan beberapa sistem dan materi yang usang di kampus.\r\n\r\nSeni Budaya karena sesuai dengan skill dan hobby saya yang paling menonjol.', 'Meningkatkan disiplin diri supaya waktu luang diisi lebih bermanfaat, ingin menjadi anggota organisasi yang skalanya lebih besar dan serius daripada yang sudah pernah, membangun koneksi yang luas, mengasah etos kerja '),
(106, 'ameyliadella123@gmail.com', 'Pengabdian Masyarakat', 'Politik dan Kesejahteraan Mahasiswa', '  Saya minat dibidang tersebut karena ingin menambah wawasan saya dibidang tersebut dan dalam bidang tersebut dapat membantu saya untuk meningkatkan rasa kepekaan dan kepedulian terhadap masyarakat internal (didalam kampus) dan eksternal (diluar kampus) sehingga dapat mempererat hubungan antara teman dan masyarakat sekitar.', '  Karena ingin menambah wawasan dan pengetahuan, meningkatkan softskill dan hardskill yang ada didalam diri saya, menambah relasi baru yang lebih luas lagi, dapat membantu public speaking saya, dan dapat menambah nilai jual dalam cv saya.'),
(107, 'benedicttitus2108@gmail.com', NULL, NULL, NULL, NULL),
(108, 'hannhdk44@gmail.com', 'Seni Budaya', 'Olahraga', '  Alasan saya memilih departemen biro seni budaya dan olahraga ialah karna saya mempunyai pengalaman volunteer pada tahun 2020 di acara FAF. 3.0 saya merasa mampu dan dapat bertanggung jawab atas tugas saya selama menjadi volunteer \r\nDan untuk pilihan kedua di bidang olahraga karna saya mempunyai minat lebih pada bidang tersebut. ', '  Alasan utama saya mengikuti BEM adalah untuk mengembangkan soft skill saya terutama dalam hal komukasi dan sosialisasi. \r\nSaya ingin mempunyai pengalaman lebih dan lebih dari yang sudah punya. Dengan mengikuti BEM saya akan memanage waktu saya antara kuliah dan organisasi. '),
(109, 'annisaoctaviani32@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Pengabdian Masyarakat', '  karena dengan memilih biro PSDM dan pengabdian masyarakat saya dapat berhubungan langsung dengan kegiatan sosial yang ada, dengan begitu saya dapat belajar lebih dan meningkatkan kualitas diri saya bagi lingkungan dan masyarakat.', '  alasan saya mengikuti BEM yaitu untuk membentuk karakter yang lebih bertanggung jawab, terbuka, dan berwawasan luas, karena dengan bergabung menjadi bagian dari BEM saya dapat memiliki teman, ilmu, dan pelajaran yang lebih banyak dari sebelumnya.'),
(110, 'aira.sc189@gmail.com', 'Penelitian dan Pengembangan', 'Pengembangan Sumber Daya Manusia', '   Alasan utama saya mengikuti Biro Penelitian dan Pengembangan dan Biro Sumber Daya Manusia karena minat saya yang sesuai dengan benefit dari Biro tersebut yaitu menambah pengalaman  untuk meningkatkan kemampuan mahasiswa dalam memecahkan suatu masalah, meningkatkan motivasi mahasiswa untuk menciptakan keberhasilan pada program kerja serta membangun karakter yang peka terhadap lingkungan. ', '  Alasan saya mengikuti BEM untuk ikut aktif berpartisipasi dalam organisasi kampus, melatih kemampuan saya dalam berorganisasi seperti sebelum-sebelumnya, melatih kemampuan berfikir rasional dan kreatif, membangun relasi pertemanan dan membuat para mahasiswa ingin selalu aktif atau saling membantu dalam organisasi atau aktivitas-aktivitas kampus atau lainnya. '),
(111, 'shofaraliaziz@gmail.com', 'Administrasi Umum', 'Penelitian dan Pengembangan', 'Alasan saya memilih biro atau departemen tersebut adalah karena ketertarikan, kemampuan dan pengetahuan saya. Saya merasa saya dapat berkontribusi lebih pada bidang yang saya minati.', 'Alasan saya mengikuti BEM adalah untuk mengisi waktu luang, menambah pengalaman berorganisasi, meningkatkan soft skills, serta memperluas relasi.'),
(112, 'ryusufsetiadi@gmail.com', 'Olahraga', 'Hubungan Masyarakat', '      1.  Alasan saya ingin bergabung dengan biro olahraga karena tentu saja saya memiliki ketertarikan kepada olahraga dan disamping itu juga saya pernah dipercayai menjadi ketua ekskul olahraga taekwondo pada saya semasa sma\r\n      2. dan untuk alasan saya memilih biro hubungan masyarakat ialah karena saya suka berinteraksi dengan seseorang dan ingin meningkatkan public speaking saya ke level yang lebih jauh lagi', '       1.Mencari relasi tentunya\r\n  2.Mencari kegiatan\r\n  3.Mengembangkan skill berorganisasi saya lebih jauh     '),
(113, 'raafii.105@gmail.com', 'Olahraga', 'Pengabdian Masyarakat', ' Saya mengambil Departemen Olahraga karena saya memiliki minat pada bidang olahraga. Dan saya mengambil Departemen Pengabdian Masyarakat karena saya memiliki rasa kepedulian terhadap masyrakat dan ingin lebih mengetahui hal hal yang ada di masyarakat.', 'Saya ingin menambah ilmu dan pengalaman berorganisasi serta memperbanyak relasi'),
(114, 'zulfahrialief10@gmail.com', NULL, NULL, NULL, NULL),
(115, 'britneyqueensly03@gmail.com', 'Seni Budaya', 'Olahraga', '  pilihan 1 (Seni Budaya) : karena sesuai dengan bakat/talenta yang ada pada diri saya sendiri khususnya dalam bidang musik, serta saya adalah pelatih vokal dan paduan suara di SMA Negeri tempat saya bersekolah dulu. Sehingga saya dapat tahu cara mengembangkan minat dan bakat mahasiswa FIKTI dalam bidang tersebut.\r\n\r\npilihan 2 (Olahraga) : karena sesuai juga dengan hobi yang saya tekuni yaitu basket dan pada SMA dulu saya menjadi koordinator sehingga saya juga cocok untuk berpartisipasi untuk mengembangkan minat dan bakat mahasiswa FIKTI dalam bidang tersebut.', '  Alasan saya mengikuti BEM adalah saya ingin berorganisasi dengan tujuan yang jelas, mengasah softskill yang saya telah pupuk selama ini, mengoptimalkan lagi waktu saya saat masa perkuliahan ini dengan mengisinya dengan kegiatan yang bermanfaat bagi diri saya sendiri terlebih untuk mahasiswa FIKTI, menambah pengalaman serta relasi, semua yang dapat saya curahkan untuk organisasi ini pasti saya berikan sesuai daya yang ada, saya tidak menjamin apapun it, namun pasti yang terbaik sesuai kemampuan saya yang akan menjadi sumbangsih untuk BEM ini.'),
(116, 'Ayunitaputri4958@gmail.com', NULL, NULL, NULL, NULL),
(117, 'poetridianp26@gmail.com', 'Akademik', 'Pengabdian Masyarakat', 'Saya memilih Bidang pendidikan dan sosial karena minat yang saya inginkan dan telah memiliki kemampuan dibidang tersebut seperti pengalaman saya dalam mengajar, membuat acara saat SMA serta bekerjasama dengan teman untuk saling membantu sesama. Saya memilih departemen akademik dan pengabdian masyarakat karena ingin memperluas pandangan dengan keadaan yang berbeda serta memberikan dampak dan hal yang positif sesuai dengan keadaan yang berlangsung,  mengembangkan rasa sosialisasi dan empati simpati, serta menjadi wadah saya sebagai generasi penerus untuk mengembangkan kesejahteraan dan kemajuan bangsa indonesia dengan menganalisis masalah yang ada lalu memberikan solusi agar masalah tersebut dapat diselesaikan. Mengembangkan kemampuan komunikasi saya dengan lingkup yang lebih luas, mengembangkan dalam leadership saya dalam mengkoordinasikan dan kreativitas dalam membuat event untuk meningkatkan prestasi mahasiswa FIKTI UG serta memberikan wadah juga ke yang lain untuk mendapatkan kegiatan yang akan dilaksanakan nanti.', '    Saya ingin mengikuti BEM FIKTI UG karena ingin mengembangkan kembali kemampuan - kemampuan saya dalam komunikasi, bersosialisasi, kreativitas, leadership yang belum tersalurkan dengan baik karena adanya Covid-19 walaupun sudah saya salurkan dalam lingkup kecil seperti kelas dengan menjadi ketua kelas, namun saya ingin lebih menyalurkan kemampuan saya agar dapat lebih meningkat dan memberikan dampak dari BEM ke lingkungan sekitar. Belajar bekerja sama dengan individu yang berbeda sifat, perilaku dan pendapat untuk tujuan yang sama dalam BEM untuk meningkatkan sarana dan prasarana serta kualitas perkuliahan dalam Fakultas Ilmu Komputer dan Teknologi di Universitas Gundarma, menyelesaikan masalah yang ada di lingkup FIKTI ataupun Universitas, dengan menganalisis masalah yang ada lalu memberikan solusi secara mufakat agar masalah tersebut dapat diselesaikan yang akhirnya saya juga dapat menambah wawasan dari berbagai pendapat dan pengetahuan saat musyawarah tersebut. Dalam hal tersebut juga saya mendapatkan teman / relasi baru sehingga memperluas lingkup pertemanan hingga Universitas lain. Pada saat mengikuti BEM saya juga dapat mempraktikan dalam meningkatkan manajemen berbagai kegiatan yang dilakukan sendiri atau tim sehingga pekerjaan yang saya lakukan tidak ada yang terganggu.  Dengan saya memilih pada open recruitmen BEM FIKTI pada bidang pendidikan dan sosial karena ingin mengabdi dengan ilmu yg saya miliki untuk disalurkan kepada khalayak luas  '),
(118, 'aisyahnurulafyna@gmail.com', NULL, NULL, NULL, NULL),
(119, 'melyanaa57@gmail.com', NULL, NULL, NULL, NULL),
(120, 'yourioscar01@gmail.com', 'Penelitian dan Pengembangan', 'Olahraga', 'Jawaban simple,karena selain saya minat dibidang yang saya pilih ini, saya rasa sangat cocok dengan pribadi saya.', 'Ingin Aktif berorganisasi dan mengasah jiwa leadership saya.'),
(121, 'amirahnfiah@gmail.com', 'Penelitian dan Pengembangan', 'Akademik', 'Alasan saya memilih pilihan pertama yaitu menjadi biro/departemen penelitian dan pengembangan, karena saya sangat ingin berkontribusi sebagai salah satu orang yang dapat membantu dalam pengembangan organisasi dan program kerja dalam menciptakan visi misi BEM Fikti itu sendiri.\r\nSedangkan alasan saya memilih pilihan kedua menjadi biro atau departemen akademik yaitu karena saya ingin menjadi wadah bagi mahasiswa/i yang ingin terus menggali prestasi mereka di bidang akademik.\r\nSaya juga merasa mampu dan percaya diri dalam melakukan tugas tugas yang ada dalam departemen ini dan juga saya merasa departemen/biro ini sesuai dengan minat dan kemampuan saya.', 'Alasan saya mengikuti BEM, karena saya merasa BEM adalah salah satu kendaraan untuk terus mengembangkan potensi dalam menjalin relasi, menambah pengalaman dalam bekerja secara tim, menghargai dan memanajemen waktu dengan lebih baik lagi. Selain itu saya juga yakin BEM dapat memfasilitasi saya untuk mengasah soft skill saya diluar bidang akademik.  '),
(122, 'firahmh15@gmail.com', 'Media', 'Hubungan Masyarakat', 'Alasan saya memilih departemen media dan hubungan masyarakat adalah berdasarkan kemampuan dan  pengalaman saya dibidang design dan humas  dalam organisasi maupun event di universitas gunadarma, menjadikan saya memiliki skill yang terus terasah untuk menjadi bagian dari institusi ini. Dengan memilih departemen ini saya harap, saya bisa memberikan yang terbaik dan menjadi bagian  dalam menyukseskan kegiatan  departemen serta organisasi mahasiswa ini.', 'Alasan saya mengikuti BEM ini dikarenakan keinginan saya dalam bergabung dalam sebuah organisasi mahasiswa yang dapat menjadi wadah bagi saya pribadi, untuk mengasah kemapuan leadership, problem solving, communication skill, team Work, dan analytical and critical thinking. serta mendedikasikan diri dan waktu saya agar bermanfaat dan mencapai cita-cita serta visi-misi organisasi ini.\r\n'),
(123, 'sandrina.spd@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Pengabdian Masyarakat', 'Alasan saya memilih biro PSDM adalah karena saya ingin menciptakan lingkungan kerja yang nyaman tetapi tetap efektif bagi para staff BEM.\r\nAlasan saya memilih biro PengMas adalah karena saya ingin BEM bisa menjadi tempat / wadah dalam melaksanakan kegiatan sosial yang positif di luar lingkungan kampus.', 'Alasan saya mengikuti BEM adalah karena saya ingin ikut berperan aktif dalam membantu semua kegiatan yang akan dibuat oleh BEM, ingin menambah pengalaman dan memperluas relasi.'),
(125, 'fathithi.m@gmail.com', 'Olahraga', 'Seni Budaya', 'Saya ingin memperdalam pengalaman berorganisasi di bidang ORSB. Saya juga ingin bisa berorganisasi sambil menekuni hobi yang sama dengan teman-teman lainnya. \r\n', ' Saya ingin menambah pengalaman, wawasan, serta memahami struktur organisasi yang lebih luas dikalangan Universitas. Di samping itu juga saya ingin memajukan program-program yang ada di BEM FIKTI dan berperan aktif di setiap kegiatan. '),
(126, 'aditbags@gmail.com', 'Pengembangan Teknologi Informasi', 'Penelitian dan Pengembangan', '  Saya memiliki ketertarikan yang tinggi pada bidang Teknologi', '  Saya ingin menjadi mahasiswa yang aktif dalam berorganisasi dan saya ingin menjadi mahasiswa yang berguna bagi kampus saya '),
(127, 'tsukmawati7@gmail.com', 'Olahraga', 'Pengabdian Masyarakat', ' Karena saya ingin merealisasikan minat saya pada bidang olahraga sekaligus ikut berpartisipasi dalam mengembangkan bakat para mahasiswa di bidang non-akademik ini. Sedangkan, alasan saya memilih pengabdian masyarakat yaitu karena saya ingin ikut berpartisipasi dalam menebarkan kebermanfaatan untuk masyarakat sekaligus belajar melalui pengalaman milik orang lain.  ', 'Karena telah terbiasa berorganisasi jadi ingin terus melanjutkan kegiatan positif tersebut dengan mengikuti BEM di masa kuliah ini. Selain itu, ingin meningkatkan softskill ataupun hardskil sampai batas terbaik nya, menambah pengalaman dan wawasan baru sekaligus memperluas relasi. \r\nAlasan lainnya, karena semua effort yang di keluarkan selama mengikuti BEM ini bisa membantu di masa depan.   '),
(128, 'arifburhanuddin332@gmail.com', 'Media', 'Seni Budaya', 'Ingin belajar serta meningkatkan kemampuan di kedua bidang pada kedua biro tersebut', 'Ingin merasakan pengalaman berorganisasi, bertemu orang baru juga menambah relasi, dan mengisi waktu luang'),
(129, 'daraismaya22@gmail.com', NULL, NULL, NULL, NULL),
(130, 'arjuluufnr11@gmail.com', NULL, NULL, NULL, NULL),
(131, 'rayhanazkia20@gmail.com', 'Seni Budaya', 'Olahraga', '  karena saya tertarik dalam bidang kesenian dan olahraga sehingga saya ingin ingin meningkatkan sekaligus menyalurkan kamampuan saya dalam organisasi ini agar bisa lebih maju kedepannya.', '  karena ingin menambah pengalaman dan jam terbang saya dalam mengikuti organisasi serta meningkatkan kemampuan public speaking dan juga team work dengan banyak orang dan saya merasa organisasi ini adalah kendaraan yang tepat untuk mengembangkan potensi yang ada di dalam diri saya.'),
(132, 'valencionafil2409@gmail.com', 'Hubungan Masyarakat', 'Akademik', '  - Alasan pertama. Mengapa saya memilih biro Hubungan Masyarakat (HUMAS), karena saya sudah memiliki beberapa pengalaman di bidang tersebut ketika berorganisasi di SMA. Oleh karena itu, saya sangat bersemangat bergabung dengan biro Hubungan Masyarakat BEM FIKTI Gunadarma. \r\n\r\n- Alasan kedua. Mengapa saya memilih biro Akademik, karena saya ingin mengembangkan dan menambah wawasan dalam bidang Akademik. ', ' Alasan saya mengikuti BEM, karena saya ingin menambah pengalaman saya dalam bidang organisasi serta mengasah kemampuan dan bakat saya. '),
(133, 'rhndkputr@gmail.com', 'Pengabdian Masyarakat', 'Pengabdian Masyarakat', '   Saya memilih biro Pengabdian masyarakat agar dapat membangun jiwa leadership yang saya miliki dan memberikan pemikiran kritis yg dapat membatu biro pengembangan sumber daya manusia ', '  Alasan saya mengikuti BEM adalah untuk menambah wawasan saya dan membangun relasi dalam berorganisasi  dan melatih softskill  yang saya miliki '),
(134, 'syahtomo23@gmail.com', 'Administrasi Umum', 'Pengembangan Sumber Daya Manusia', ' Alasan saya memilih departemen atau biro tersebut karena menurut saya  keahlian saya akan dapat berkembang lebih baik lagi jika di tempatkan atau di tugaskan menjadi Administrasi umum dan pengembangan sumber daya manusia. Karena menurut saya pribadi juga passion saya ada di antara 2 pilihan tersebut. Saya juga sangat suka kegiatan seperti input data, serta mangatur keuangan. Menurut saya pribadi mejadi administrasi umum merupakan suatu bekal yang bagus jika saya sudah lulus nanti dan bekerja, pasti skill administrasi menjadi skill minimal yang wajib di kuasasi oleh calon pegawai kantoran.', '  Alasan saya mengikuti BEM universitas gunadarma adalah :\r\n\r\nyang pertama alasan saya mengikuti BEM saya ingin mengerti dan belajar cara berorganisasi dengan baik \r\ndan benar. saya merasa Sangat beruntung apabila saya dapat\r\nmerasakan pengalaman berorganisasi melalui BEM yang penuh dinamika dan akan \r\nmemperkaya wawasan dan keahlian saya sendiri.\r\n\r\nyang kedua alasan saya mengikuti BEM saya ingin meningkatkan soft \r\nskill pada diri saya seperti belajar dan memahami tentang leadership,\r\nProblem Solving, Communication Skill, Team Work, serta Analytical and Critical \r\nThinking dengan baik dan benar.\r\n\r\nyang ketiga alasan saya  mengikuti BEM saya ingin melatih diri saya\r\nkhususnya dalam memanage berbagai kegiatan dengan baik dan benar, \r\nbaik yang dilakukan sendiri ataupun secaratim. Melalui BEM, saya akan\r\nbelajar mengelola diri dan kegiatan-kegiatan yang ada di dalamnya. \r\nAktif di BEM adalah cara paling baik menambah pengalaman saya melalui \r\npraktik langsung selama masa kuliah.\r\n\r\nyang keempat alasan saya mengikuti BEM saya ingin menamabah wawasan dalam segala hal.\r\nDi BEM saya akan bergabung dan bertemu dengan orang-orang yang telah memiliki lebih banyak \r\npengalaman dibandingkan saya sendiri. Orang-orang tersebut adalah para senior ataupun \r\npihak kampus yang memiliki keterkaitan erat dengan kegiatan BEM. Melalui merekalah saya \r\nakan mendapatkan pengetahuan yang lebih banyak mengenai banyak hal.\r\n\r\nyang ke lima alasan saya mengikuti BEM saya ingin meluaskan relasi dan networking.\r\nBerbagai pihak yang saya kenal di saat berorganisasi di dalam BEM akan dapat menjadi \r\nkeuntungan yang tidak akan saya duga di masa depan. Semakin luas saya membina hubungan \r\nbaik dengan berbagai pihak, maka akan memudahkan saya dalam dunia selepas kuliah.\r\n\r\nalasan terakhir saya mengikuti BEM saya ingin menambah nilai jual dalam CV(Curriculum Vitae)saya pribadi.\r\nSebagai seorang mahasiswa yang baru lulus atau fresh graduate, sangat wajar apabila keterangan pengalaman\r\ndi CV masih minim atau bahkan kosong sama sekali. Akan menjadi sebuah keuntungan apabila saya dapat \r\nmencantumkan pengalaman organisasi yang disertai dengan peran dan fungsi yang saya emban. Ditambah dengan\r\nberbagai kegiatan di mana saya secara aktif terlibat di dalamnya.Menurut saya Pihak perusahaan akan lebih\r\nmenyukai seorang fresh graduate yang sudah memiliki pengalaman berorganisasi yang akan memudahkan adaptasi\r\nseorang karyawan baru untuk lebih cepatnya lagi berkontribusi dalam pekerjaannya. Terlebih pengalaman organisasi \r\ndi dalam BEM yang cukup prestisius di mata sebagian orang. \r\n \r\n\r\n\r\n  '),
(135, 'felixgeovanynababan@gmail.com', 'Administrasi Umum', 'Akademik', '  Saya memilih Administrasi Umum karena saya sudah menjalani dalam sebuah bidang dana dalam UKM agama Kristen yang sedang berjalan sekarang', '  Saya mau mengembangin minat bakat saya di bidang akademik, seperti workshop, seminar dan kompetisi'),
(136, 'haniefislsbl@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Pengabdian Masyarakat', 'Alasan saya memilih Biro Pengembangan Sumber Daya Manusia adalah karena saya merasa cocok dan ingin berkontribusi dalam menyusun strategi Pengembangan SDM dengan merangkul pengurus agar dapat menciptakan lingkungan kerja yang positif di dalam BEM FIKTI UG serta, saya berharap dapat mengembangkan diri saya sendiri dalam pembentukan personalia saat bersaing di masa yang akan datang. \r\n\r\nAlasan saya memilih Departemen Pengabdian Masyarakat adalah karena saya ingin menerapkan ilmu saya dan memberi dampak positif kepada masyarakat dengan berkontribusi aktif terhadap isu sosial masyarakat, serta mempelajari hal baru dengan saling memahami perbedaan keadaan sesama masyarakat. Saya berharap ilmu saya bisa bermanfaat bagi orang lain. ', 'Alasan saya mengikuti BEM adalah, karena saya ingin menyalurkan ide dan aspirasi saya di dalam program kerja BEM,  saya juga ingin mengisi waktu luang saya selama kuliah dengan kegiatan yang bermanfaat, menambah relasi dan pengalaman dalam berorganisasi. Saya berharap ilmu yang saya dapat bisa diimplementasikan dalam organisasi ini, dan melatih public speaking, jiwa kepemimpinan, serta dapat mengembangkan potensi diri saya. '),
