(140, 'shofiani02@gmail.com', 'Administrasi Umum', 'Akademik', '  Alasan saya untuk memilih departemen administrasi umum karna saya memiliki pengalaman pada bidang tersebut.\r\n\r\nAlasan saya untuk memilih akademik karna saya ingin mengajak teman teman saya untuk mengasah bakat yang mereka miliki namun belum mengetahui wadahnya.', '  Pertama saya ingin menambah pemgalaman serta wawasan dalam berorganisasi'),
(141, 'dimasfebrians190902@gmail.com', NULL, NULL, NULL, NULL),
(142, 'safiralonita19@gmail.com', 'Seni Budaya', 'Pengabdian Masyarakat', 'Alasan memilih Departemen Seni Budaya karena ingin menambah pengalaman di bidang seni budaya, secara pribadi saya memiliki ketertarikan lebih pada seni rupa dan musik. Pernah menjadi panitia acara seni budaya di SMA pada tahun 2017, mengikuti pentas paduan suara tahun 2016-2017, tutor visual art seni rupa tahun 2018-2019. \r\n\r\nAlasan memilih Departemen Pengabdian Masyarakat karena ingin berkontribusi secara aktif dalam kegiatan sosial. Ingin menjadi pribadi yang bermanfaat bagi masyarakat luas dan meningkatkan kepekaan terhadap masalah sosial di sekitar.\r\n', 'Ingin ikut berkontribusi dalam kemajuan fakultas, meningkatkan softskill, mengasah potensi berorganisasi, belajar kepemimpinan dan manajemen waktu serta menambah relasi'),
(143, 'adi.kristian45@gmail.com', NULL, NULL, NULL, NULL),
(144, 'virli.nisa@gmail.com', 'Administrasi Umum', 'Akademik', '  Untuk pilihan 1 kenapa saya memilih administrasi umum, dari pengalaman organisasi saya sebelumnya, saya pernah ditempati pada divisi yang job descnya hampir sama seperti divisi administrasi umum ini. Dan jurusan sekolah saya di SMK berhubungan juga dengan administrasi, jadi saya kurang lebih sudah tau dan paham untuk job desc divisi yang saya pilih bedasarkan pengalaman saya. Saya juga suka mengerjakan hal-hal yang berkaitan dengan administrasi, mengerjakan tugasnya membuat saya senang seperti seorang pegawai yang sedang mengerjakan tugasnya dikantor.\r\n\r\nUntuk pilihan 2 kenapa saya memilih divisi akademik karena di divisi akademik ini kita bisa berinteraksi dengan banyak orang, bisa menambah relasi, bertemu orang-orang industri, lalu mengasah skill public speaking karena kita akan berinteraksi dengan banyak orang baru, berbicara di depan banyak orang dan akan merealisasikan banyak proker, kayanya seru seperti di pengalaman organisasi saya sebelumnya sebagai osis banyak proker yang harus di realisasikan.     ', '    Ingin tau organisasi di kampus seperti apa sih? apa bedanya dengan organisasi waktu di sekolah? karena kalau di universitas lingkupnya luas tidak seperti di sekolah dan kita akan berinteraksi bukan sesama mahasiswa saja, kita akan berinteraksi dengan dosen, orang-orang external kampus dan dari sini kita akan mendapatkan relasi yang banyak, juga saya ingin menambah wawasan baru, ilmu baru, cari tau apa yang kita belum tau, pasti dari ikut organisasi di universitas yang lingkupnya cukup luas kita akan mendapatkan hal-hal baru yang belum kita ketahui sebelumnya. Saya juga ingin menambah pengalaman baru untuk menambah porto folio juga sih sebenernya dan mencari relasi sebanyak mungkin dari ikut BEM ini.    '),
