(149, 'zafira.alindra2328@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Pengabdian Masyarakat', '    Untuk menambahkan kesadaran tentang kondisi masyarakat sekitar, serta menjaga hubungan kekeluargaan antar anggota BEM FIKTI UG agar kinerja tetap berjalan dengan baik. ', '    Ingin menjadikan BEM FIKTI UG lebih baik dengan terus menjalankan program-program kerjanya.'),
