(151, 'nurulelizafeb@gmail.com', 'Pengabdian Masyarakat', 'Pengembangan Sumber Daya Manusia', ' ingin belajar hal baru dan membangun jaringan relasi dalam lingkungan sosial masyarakat serta menjadi pribadi yg berguna dan tinggi simpati, karena sebaik-baiknya manusia adalah yg paling bermanfaat bagi manusia lainnya ', ' untuk menambah wawasan dan mengasah softskill dalam berpikir kritis seperti menyelesaikan masalah yg kadang terjadi dalam organisasi. selain itu, ingin belajar menjadi pribadi yg percaya diri serta menambah pengalaman dalam bekerja sama dengan tim yg nantinya akan dibutuhkan dalam dunia kerja '),
(152, 'huussenn743@gmail.com', NULL, NULL, NULL, NULL),
(153, 'alifyaalifa00@gmail.com', 'Olahraga', 'Administrasi Umum', ' Ingin berkontribusi dalam Badan Eksekutif Mahasiswa ini sebagai inisiator dan fasilitator yang mewadahi minat bakat mahasiswa/i FIKTI dalam bidang olahraga untuk meningkatkan prestasi non akademik dan menjadi  daya tarik bagi mahasiswa/i FIKTI, juga karena tingginya minat saya terhadap kegiatan di bidang olahraga. ', ' Untuk menambah pengalaman dan belajar dalam berorganisasi, memperluas relasi dan hubungan baik, meningkatkan kepercayaan diri dan kemampuan berkomunikasi. Juga ingin menjadi wadah penyalur aspirasi dan prestasi bagi mahasiswa/i FIKTI baik untuk internal maupun eksternal, ingin lebih mengetahui tentang kehidupan perkuliahan yang akan menjadi informator yang akurat bagi mahasiswa/i FIKTI. '),
(154, 'fadrioktavian@gmail.com', 'Seni Budaya', 'Media', '     Alasan saya memilih Dapartemen Seni dan Budaya Karena saya suka seni terutama di seni musik. dan saya ingin mengembangkan bakat saya di dapartemen ini. Selain itu saya ingin mengangkat, mengembangkan, dan memperkenalkan Seni Budaya terutama seni tradisional di kalangan remaja.\r\n\r\n Alasan Saya memilih Dapartement Media karena saya cukup berpengalaman dan memiliki skill di bidang multimedia, maka dari itu saya tertarik menjadi bagian di dapartemen media ', '     Saya ingin menambah pengalaman saya di bidang organisasi. saya ingin melatih dan mempraktekan softskill, komunikasi, problem solving, manajemen waktu, manajemen emosi, kedewasaan, komitmen dan Presentasi pada diri saya\r\n\r\n   '),
(155, 'rikiazwarqwr@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Pengabdian Masyarakat', 'Sangat cocok dengan saya yang selalu ingin tau dengan hal baru, yang selalu ingin mempunyai banyak koneksi. ', 'Ikut berkontribusi dalam sebuah organisasi. Ingin menambah banyak pengalam organisasi. Ingin mengasah lagi diri saya menjadi lebih baik. '),
(156, 'desioktavia333@gmail.com', 'Administrasi Umum', 'Bisnis dan Kemitraan', '   saya adalah orang yang menyukai ketelitian, terbiasa bekerja secara multi tasking sehingga kualifikasi untuk posisi sebagai administrasi sangat cocok bagi saya ', '   Ingin Belajar Berorganisasi, meningkatkan soft skill,Menambah Nilai Jual dalam Curriculum Vitae (CV) ,Meluaskan Relasi dan Networking '),
(157, 'calvinadtya09@gmail.com', 'Seni Budaya', 'Seni Budaya', '  Karena saya (Aditya Calvin Bima), ingin mengembangkan hobi bermain alat musik di divisi seni budaya. Dan untuk lebih mendalami passion saya di bidang musik, serta bisa ikut berkontribusi untuk BEM FIKTI Universitas Gunadarma di divisi Seni Budaya', ' Menambah pengalaman dalam berorganisasi. Menambah teman. Belajar manajemen waktu. Dan ingin ikut berkontribusi dengan kemampuan yang saya miliki'),
(158, 'faridardiansyah061@gmail.com', 'Pengabdian Masyarakat', 'Olahraga', '  pengen menjadi percaya diri ', '  menambah relasi pertemanan , nambah cv'),
(159, 'ahmadmawardihakim7@gmail.com', 'Akademik', 'Pengabdian Masyarakat', 'Untuk pilihan pertama, Saya sangat tertarik dengan tugas yang diemban oleh departemen akademik, yaitu meningkatkan minat dan bakat serta prestasi mahasiswa FIKTI UG. Berdasar pengalaman, saya pun sudah mengikuti beberapa progam kerja yang dilaksanakan departemen ini dan saya sangat merasa terbantu dan merasa manfaat yang cukup besar. Dari sana saya menjadi tertarik dan timbul rasa untuk ikut membantu mejalani proker-proker yang dijalankan oleh departemen akademik secara langsung. Dan dengan ini, saya dapat memberi impact bagi orang lain.\r\n\r\nUntuk pilihan kedua, saya dapat dikatakan cukup peka dan peduli terhadap lingkungan, dan saya pikir saya dapat menuangkan hal tersebut dengan memasukki departemen Pengabdian Masyarakat. Selain itu, menurut saya tugas dari departemen ini sangat mulia dengan memberi berkah kepada orang sekitar, hal tersebut dapat memberi efek yang baik bukan hanya untuk diri saya tetapi juga untuk orang lain. Dengan memasukin departemen ini pula saya dapat secara langsung attach kepada masyarakat dan memberi impact kepada mereka.\r\n', 'Saya merupakan orang yang selalu ingin belajar hal baru, hal baru ini dapat berupa pengalaman dan ilmu yang tidak saya dapatkan di kelas. Hal tersebutlah yang menjadi alasan besar saya mendaftaran diri menjadi bagian dari BEM FIKTI. Saya yakin bahwa BEM dapat menjadi wadah bagi saya untuk berkembang dan belajar hal-hal tersebut melalui pengalaman pengalaman yang nantinya akan saya hadapi.\r\n\r\nSelain untuk berkembang dan belajar hal baru, saya juga sangat ingin memberikan impact, bukan hanya bagi diri sendiri tetapi juga orang lain, entah di lingukangan kampus ataupun di luar kampus. Mungkin bukan dampak besar tapi setidaknya jika saya berada di dalam BEM, saya memiliki hak lebih untuk memberikan kinerja saya guna memberi perubahan positif yang berdampak.\r\n'),
(160, 'aldyra.fadhil@gmail.com', 'Olahraga', 'Penelitian dan Pengembangan', '   Karna hobi saya olahraga dan bermain game jadi saya ingin mengembangkan di bidang tersebut menjadi lebih baik ', '  Menambah Relasi, menambah wawasan, melatih public speaking'),
