(162, 'damarrudinkamil999@gmail.com', NULL, NULL, NULL, NULL),
(163, 'dhiazulfahaq2001@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Pengabdian Masyarakat', '        Alasan saya memilih PSDM dan pengabdian masyarakat karena saya yakin jika saya memasuki salah satu divisi tersebut saya akan beradaptasi sangat cepat untuk mengikuti program kerja dalam divisi yang ada dan ikut bertanggug jawab dalam team divisi tersebut.      ', '        Alasan saya mengikuti BEM FIKTI untuk menambah wawasan pada organisasi tingkat universitas dan juga belajar bekerja sebagai team.\r\nSaya yakin saya dapat cepat beradaptasi dan berkontribusi aktif bagi divisi yang akan saya tuju.    '),
(164, 'khalifiamutiara@gmail.com', 'Media', 'Seni Budaya', '    Alasan saya memilih departemen tersebut, karena saya ingin meningkatkan skill yang saya punya dan membuat menarik perhatian untuk mahasiswa gunadarma dan para pengguna sosial media.   ', '    Karena saya ingin menambahkan skill, memiliki kegiatan dan pengalaman yang baru.  '),
(165, 'naufal.irawan3@gmail.com', 'Akademik', 'Hubungan Masyarakat', '   Kedua pilihan tersebut sejalan dengan passion yang saya miliki selain itu menurut saya keduanya memiliki potensi peran yang cukup besar dalam kemajuan BEM FIKTI kedepannya yang mana saya ingin ikut berkontribusi dan mendalami bidang tersebut. ', '   Dengan loyalitas yang saya miliki Saya ingin menjadikan kampus tidak hanya sebagai tempat kuliah tetapi sebagai wadah untuk menambah jam terbang dalam berorganisasi dan mengembangkan soft skill  yang nantinya akan berguna di masa yang akan datang dan saya rasa BEM adalah wadah yang tepat untuk mendapatkan itu semua. '),
(166, 'adindabellad22@gmail.com', 'Media', 'Pengabdian Masyarakat', 'Saya memilih biro media karena saya memiliki minat dan bakat dalam bidang design. saya dapat menggunakan beberapa software design seperti adobe photoshop, adobe illustrator, dan canva. Saya sangat menikmati pekerjaan dalam bidang mendesain sehingga saya mampu bekerja dalam biro media.\r\n\r\nSaya memilih departemen pengabdian masyarakat karena saya sangat peka terhadap masalah disekitar saya. Selain itu, saya mudah beradaptasi di mana saja dan saya senang bekerja dengan banyak orang. Saya sudah terbiasa mengikuti kegiatan yang mana selalu bertemu dengan orang banyak.', 'Selain menambah pengalaman dan relasi, mengikuti BEM merupakan salah satu hal yang saya ingin lakukan semenjak masuk di dunia perkuliahan. saya suka belajar mengenai hal-hal baru untuk saya sehingga dengan bergabung dengan BEM saya dapat mendapatkan pelajaran atau hal-hal baru yangh belum saya dapatkan sebelumnya.'),
(167, 'asyairifa@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Seni Budaya', 'Alasan saya memilih biro PSDM untuk mengoptimalkan potensi saya dalam hal manajerial organisasi dan soft skill serta saya juga tertarik dengan biro ini karena Biro PSDM bertugas melakukan kegiatan-kegiatan yang melibatkan semua anggota BEM, sehingga saya dapat membantu menjaga dan menigkatkan solidaritas dan rasa kekeluargaan antar anggota melalui program kerja dan jobdesk yang akan saya terima nantinya. \r\n\r\nBidang kedua yang saya pilih yaitu departemen seni budaya, alasan saya memilih departemen seni budaya yaitu karena saya menyukai seni dan saya memiliki pengalaman dalam hal seni terutama seni tari, dan saya merasa bahwa departemen ini dapat menampung dan menyalurkan minat dan bakat mahasiswa dalam bidang seni melalui program kerja yang akan dibuat nanti, seperti perlombaan, penampilan, serta pentas seni yang dapat memberi manfaat bagi mahasiswa.', 'Alasan saya mengikuti BEM yaitu karena saya ingin menambah pengalaman serta belajar berorganisasi, serta saya yakin dengan mengikuti BEM dapat membantu saya dalam meningkatan soft skill, menambah wawasan dan relasi, serta saya dapat belajar memanajemen diri dan waktu.\r\n'),
(168, 'irfanudin513@gmail.com', 'Pengembangan Teknologi Informasi', 'Politik dan Kesejahteraan Mahasiswa', ' pilihan 1 = alesan saya memilih biro pti karena saya ingin mengembangkan kemampuan saya di bidang web untuk memasuki dunia kerja nantinya.\r\n\r\npilihan 2  = alesan saya memilih biro strategi dan propaganda(departemen politik dan kesma) karena saya ingin mengentahui tentang perlindungan data pribadi yang saat\r\n                      ini sedang marak pencurian data. ', '  ingin menambah relasi dan pengalaman.'),
(169, 'berlinsugandhi08@gmail.com', 'Politik dan Kesejahteraan Mahasiswa', 'Pengabdian Masyarakat', '  alasan saya memilih kedua departemen tersebut ialah karena benefit atau penjelasan yang sudah saya baca itu berhubungan dengan tujuan saya yaitu, membangun FIKTI ug menjadi lebih baik lagi untuk kedepan nya, memperkuat hubungan antara mahasiswa FIKTI ug baik dari jurusan sistem informasi maupun jurusan sistem komputer  dan juga meningkat kan rasa kepekaan atau keperduliaan terhadap masyarakat, serta membangun pribadi saya menjadi lebih baik lagi.', 'ada beberapa alasan kenapa saya mengikuti BEM yaitu diantara nya ialah saya ingin belajar berorganisasi dan meningkatkat softskill saya dalam berkomunikasi serta menambah wawasan dan memperluas relasi atau networking dengan berbagai macam pihak.'),
(170, 'osvaldo123.putrantio@gmail.com', NULL, NULL, NULL, NULL),
(171, 'graciaagatha17@gmail.com', NULL, NULL, NULL, NULL),
(172, 'rizkids562@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Pengabdian Masyarakat', 'alasan saya memilih biro PSDM dan Pengabdian  Masyarakat karena saya yakin jika saya memasuki salah satu divisi tersebut saya akan ikut bertanggung jawab dan berpartisipasi dalam divisi tersebut.', 'alasan saya mengikuti BEM untuk menambah pengalaman dan saya yakin  menambah banyak skill, seperti komunikasi, manajemen waktu, manajemen emosi, kedewasaan, dan presentasi.dan menjadi nilai plus saat mencari  perkerjaan\r\n\r\n'),
(173, 'saputraarel@gmail.com', 'Hubungan Masyarakat', 'Pengembangan Teknologi Informasi', 'Alasan Memilih Humas = Kenapa Humas? Karena saya suka berhubungan dengan orang banyak. Saya orangnya supel, energic, mudah akrab sama orang lain, penuh semangat dan selalu berusaha untuk ceria. Saya pikir saya bisa memanfaatkan apa yang ada di dalam diri saya dengan menyalurkannya di Humas. Banyak yang bilang, katanya orang Humas itu kerjaannya banyak. Thatâ€™s no problem! Lagian kita kan ga kerja individual, kita itu satu tim (anggep aja gitu). Jadi seberat apapun kerjaan kita, kalo kita bisa bekerja sama dan membagi pekerjaan dengan baik, saya yakin smuanya ga akan terasa berat lagi. Iya kan?? Hal ini juga sebagai ajang pembelajaran dan latihan buat saya untuk membiasakan diri bekerja keras sampai titik darah penghabisan. Di dunia kerja, kita juga bakalan ketemu orang banyak dan kerjaan yang numpuk menggunung, kalo kita udah terbiasa, kita bakalan lebih tenang dan enjoy dalam bekerja dan bersaing dengan yang lainnya. Selain itu, kalo di Humas kita bisa kenal banyak orang, so kita punya banyak koneksi. Gitu...\r\n\r\nThatâ€™s all about alasan saya masuk Humas. Disini, saya bener-bener belum punya skill yang bisa saya banggain. Oleh sebab itu,, saya minta bantuan, arahan, saran, kritik, dukungan dan dorongan dari temen-temen Humas smuanya supaya saya bisa mengembangkan diri saya, paling tidak lebih baik dari saat ini.\r\n\r\nAlasan memilih pengembangan Teknologi Informasi = Karena saya menyukai Teknologi Informasi dan ingin memperbarui hal-hal yang berbau Teknologi Informasi yang ada di BEM FIKTI UG ini.\r\n\r\n ', '   Dengan ikutan organisasi, akan ada banyak manfaat untuk diri kita nantinya, seperti pengembangan soft skills yang memang nggak didapatkan secara formal di kelas. Yaitu, Melatih kepemimpinan,Melatih skill dan perkembangan hobimu,Belajar berpikir lebih kritis,Memperluas koneksi,Modal melamar pekerjaan,Belajar manajemen waktu. '),
(174, 'irfun0@gmail.com', 'Politik dan Kesejahteraan Mahasiswa', 'Administrasi Umum', ' Alasan saya memilih biro-biro ini timbul dari keinginan saya yang ingin mengenal bagaimana cara organisasi dalam me-manage organisasinya secara internal juga eksternal', '   Alasan mengikuti BEM, itu sebenernya simpel. hanya karena ingin mengikuti organisasi yang paling berpengaruh di kampus '),
(175, 'farhankhoirudin1@gmail.com', 'Hubungan Masyarakat', 'Pengabdian Masyarakat', ' saya mempunyai kemampuan dalam berkomunikasi serta meningkatkan rasa ke perihatinan dan kepedulian terhadap kondisi masyarakat di sekitarnya, dan juga membantu untuk menjadi pribadi yang lebih baik dan dapat menghargai perbedaan yang tengah terjadi di antara masyarakat sekitar.', '   Untuk menambah pengalaman dalam ber organisasi agar nantinya bisa di terapkan dalam lingkungan kerja '),
(176, 'ax2315761@gmail.com', NULL, NULL, NULL, NULL),
(177, 'fadiyaqp@gmail.com', NULL, NULL, NULL, NULL),
(178, 'rayhanresza06@gmail.com', NULL, NULL, NULL, NULL),
(179, 'feryheriyandii@gmail.com', 'Seni Budaya', 'Olahraga', ' Dilihat dari pengalaman yang pernah saya lalui dan jobdesk yang telah saya lihat, sepertinya saya cocok untuk bergabung ke dalam 2 divisi diatas, karena saya sebelumnya pernah membuat acara serupa, baik dari smp maupun sma, jadi saya pikir saya cocok untuk kedua divisi yang saya pilih.', '  Alasan pertama kenapa saya ingin mengikuti BEM ialah, ingin menambah relasi kepada mahasiswa FIKTI melalui organisasi BEM ini.\r\nKedua, saya sangat suka bekerja dalam kelompok, karena itu sangat memperluas pandangan saya terhadap pola pikir setiap orang yang berbeda beda.\r\nKetiga, ingin melanjutkan kebiasaan saya untuk berorganisasi disetiap pendidikan yang saya tempuh.\r\nKeempat, ingin menambah ilmu serta pengalaman. karena saya yakin ilmu dapat di raih dimana saja, tidak berfokus kepada pendidikan formal saja, dan pengalaman bisa di dapat darimana saja, tidak berfokus di satu tempat saja.\r\nSekian :)'),
(180, 'cikaltania300@gmail.com', 'Hubungan Masyarakat', 'Penelitian dan Pengembangan', '  Alasan saya memilih biro humas tentunya dikarenakan saya senang dalam menggunakan sosial media dan saya mempunyai pengalaman mengikuti technofair 8.0 sebagai divisi humas juga. ', 'Sebagai mahasiswa gunadarma saya  ingin mempunyai banyak pengalaman organisasi di jurusan ini saya ingin berkontribusi dalam melaksanakan acara dan tugas-tugas yang nantinya akan diberikan sebagai wadah pengembangan diri juga dan tentunya agar memperluas relasi karena mengikuti BEM FIKTI ini banyak juga benefitnya. Semoga saya mengikuti tahap selanjutnya dan bisa diterima sebagai anggota BEM FIKTI UG.'),
(181, 'aryn.shei@gmail.com', NULL, NULL, NULL, NULL),
(182, 'febryanmp7@gmail.com', 'Akademik', 'Pengabdian Masyarakat', 'ingin menambahkan pengalaman mengembangkan acara dalam bidang acara akademis seperti workshop. kompetisi dan seminar, menambahkan pengalaman untuk berkomunikasi lebih baik lagi kepada orang lain. ', '  alasan nya, biar lebih produktif , dan agar bisa menjadi lebih bermanfaat untuk diri sendiri ataupun orang lain . '),
(184, 'rdputra101200@gmail.com', 'Pengabdian Masyarakat', 'Olahraga', '  Pilihan 1\r\nAlasan saya memilih Departemen Pengabdian Masyarakat karena untuk mengasah kemampuan komunikasi, memperluas jaringan relasi, memberi manfaat langsung kepada masyarakat, media belajar hal baru dan menjadi pribadi yang sabar dan simpati. Dengan pengabdian masyarakat, kecil maupun besar sebuah pengabdian tidaklah membedakan karena pengabdian yang kecil sangat berpengaruh bagi masyarakat yang besar jika secara kontinu dilakukan.\r\n\r\n\r\nPilihan 2\r\nAlasan saya memilih Departemen Olahraga karena saya suka bermain  futsal, voli, bulutangkis, dan catur, dan juga suka hal-hal yang berhubungan dengan olahraga, dan suka menjaga kesehatan, dan juga ingin mengembangkan minat dan bakat saya di bidang olahraga.     ', '  Alasan saya mengikuti bem karena saya ingin menambah pengalaman dan jam terbang saya dalam mengikuti organisasi, saya merasa bahwa organisasi ini merupakan kendaraan yang tepat untuk saya mengembangkan potensi yang saya miliki, saya memang suka mengikuti organisasi dan saya memiliki banyak teman dan saya bisa bekerja sama dengan banyak orang dan menambah nilai jual dalam Curriculum Vitae (CV) dan juga meningkatkan soft skill seperti leadership, problem solving dan team work.       '),
(185, 'furqonajjadagh06@gmail.com', NULL, NULL, NULL, NULL),
(186, 'regitazahra@gmail.com', NULL, NULL, NULL, NULL),
(187, 'sqiqilah@gmail.com', 'Politik dan Kesejahteraan Mahasiswa', 'Penelitian dan Pengembangan', 'saya selalu merasa tertantang jika ada dalam posisi untuk menyelesaikan/meluruskan/mempertimbangkan suatu isu terkait masyarakat universitas. tertantang dalam arti, saya senang belajar berpikir kritis dan mencoba seni politik walaupun hanya dalam lingkup kecil. dan tentunya tujuan utamanya adalah agar saya dapat merangkul mahasiswi FIKTI UG untuk selalu bergerak sesuai dengan kebijakan yg berlaku baik kebijakan internal/eksternal. ', 'alasan saya mengikuti BEM karna pastinya untuk terus mengupgrade softskill saya dalam berinteraksi secara sosial dan terus mempunyai pola pikir yang kritis. selain itu saya memang sangat senang berorganisasi sejak SMP, dengan berbagai jenis organisasi. jadi pastinya saya akan terus mendalami/mengenal organisasi lainnya dimanapun saya berada dan kapanpun itu. dan mungkin alasan secara umum adalah untuk menambah pengalaman aktif berorganisasi saat kuliah dimana biasanya itu sangat penting untuk mendaftar didunia kerja. '),
(188, 'putrisyiffa01@gmail.com', 'Hubungan Masyarakat', 'Politik dan Kesejahteraan Mahasiswa', '   - Alasan saya memilih divisi Humas\r\n     * karena saya cenderung lebih suka untuk berkomunikasi dan berhubungan  dengan banyak orang, dan dari situ saya bisa menambah lebih banyak relasi dengan masyarakat atau teman baik di dalam maupun di luar kampus.  Saya juga termasuk pribadi yang ekstrovert jadi bisa lebih mudah untuk akrab dan berbincang dengan stranger. Dan saya juga aktif dibeberapa sosial media, dan disetiap sosial media tersebut karakter saya berbeda tapi masih dalam karakter positif, karna untuk mengikuti alur algoritma sosial media tersebut.\r\n- Alasan saya memilih divisi politik dan kesejahteraan mahasiswa\r\n   * karena saya tertarik dengan hal-hal yang berbau kritik dan saran. akan banyak diskusi dan pembicaraan tentang hal itu dan banyak pro dan kontra. dan diskusi adalah hal yang saya sukai. karna akan membuat pikiran saya meluas jangkauanya dan pengetahuan tentang hal-hal baru semakin bertambah.', '   melatih skill leadership, melatih dan mengasah kemampuan untuk publik speaking, mengasah kedisiplinan dan manajemen waktu, memperluas pengetahuan politik dan organisasi, menambah relasi, menambah nilai plus pada CV. '),
(189, 'ihsanulalif12@gmail.com', 'Pengembangan Teknologi Informasi', 'Media', '   Saya memiliki minat terhadap bidang web development dan saya juga memiliki minat terhadap media. Karena, saya menyadari bahwa bidang media itu sangat penting dalam kehidupan kita sehari-hari supaya kita tau apa saja yang terjadi yang didunia ini. Lalu, saya juga memiliki alasan kenapa saya mempunyai minat bidang web development itu karena saya menyadari bidang IT/Teknologi Informasi ini semakin berkembang tentu saja dan saya menyadari bahwa pembauatan website ini sangat dibutuhkan pada saat sekarang ini, khususanya bagi perusahaan.  ', '   Alasan saya mengikuti BEM ini karena saya ingin mempunyai pengalaman di bidang keorganisasian dan saya ingin keluar dari zona nyaman saya. Sebagai informasi, saya sebelumnya tidak memiliki pengalaman di bidang organisasi, maka dari itu saya tertarik untuk mendapatkan pengalaman di bidang organisasi ini.'),
(190, 'ispapramudyasetiawan@gmail.com', 'Seni Budaya', 'Olahraga', '    Saya yakin dengan kemampuan yang saya miliki, saya dapat berkontribusi dengan baik di departemen tersebut.  ', '    Ingin menambah pengalaman, menambah relasi, serta ingin memberikan kontribusi/membantu BEM FIKTI khususnya pada departemen yang saya pilih. '),
(191, 'nazaro070502@gmail.com', NULL, NULL, NULL, NULL),
(192, 'adil.bijakitaqwaislami.at@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Akademik', '     Saran dari seseorang, dan saya tertarik juga untuk hadir di depar/biro itu   ', '   Belajar cara memahami konsep organisasi dan saling membantu antar sesama   '),
(193, 'fadilahfaturahman14@gmail.com', 'Media', 'Seni Budaya', 'Alesan saya memilih bidang tersebut, karena bidang tersebut adalah bidang yang bisa saya kuasai. ', ' Alasan mengikuti BEM, yaitu untuk lebih ke pengembangan diri dan mencari relasi baru beserta pengalaman didalam sebuah organisasi lingkungan bem Fikti. '),
(194, 'farhan10rifqi@gmail.com', NULL, NULL, NULL, NULL),
