(197, 'dragorinow@gmail.com', 'Seni Budaya', 'Olahraga', '  Karena saya tertarik oleh jurusan itu dan saya  memiliki kriteria dan pengalaman untuk berkerja di departemen tersebut.', '  Saya mengikuti BEM karena ingin mencoba sesuatu yang baru, bersosialisasi dengan lingkungan BEM,dan saya yakin pengalaman BEM akan berguna untuk di kehidupan kerja saya nanti.'),
(198, 'dimasfadilahm29@gmail.com', NULL, NULL, NULL, NULL),
(199, 'khowarizmih1800@gmail.com', NULL, NULL, NULL, NULL),
(200, 'sagaramuktitri@gmail.com', NULL, NULL, NULL, NULL),
(201, 'hakimfadhli737@gmail.com', NULL, NULL, NULL, NULL),
(202, 'anandaafahriza@gmail.com', NULL, NULL, NULL, NULL),
(203, 'mieskezara93@gmail.com', 'Pengabdian Masyarakat', 'Seni Budaya', '   Alasan saya memilih pengabdian masyarakat tentunya karena ketertarikan saya dengan departemen ini. Selain alasan itu saya juga ingin berkembang dan menggali potensi saya didalam komunitas ini dan memberikan manfaat kepada masyarakat diluar sana baik secara langsung maupun tidak langsung, bahkan sekecil apapun manfaat tersebut.\r\nSedangkan alasan saya memilih seni budaya menjadi pilihan kedua karena saya memiliki ketertarikan dengan seni budaya dan juga saya ingin berkecimpung dalam mengurus acara musik dan sebagainya. Menurut saya, memilih seni budaya menjadi pilihan kedua adalah hal yang tepat, karena selain pengabdian masyarakat, saya juga dapat berkontribusi dengan baik di departemen ini. ', '   Alasan saya mengikuti BEM karena saya ingin aktif dalam berorganisasi dan ingin mengasah soft skill saya seperti meningkatkan kemampuan komunikasi dengan orang disekitar, melatih kemampuan bekerjasama didalam tim serta belajar untuk berfikir kritis dalam menangani sebuah masalah. Dan juga saya ingin memperluas relasi. ');
INSERT INTO `users_choose_point` (`id_point`, `email`, `choose_one`, `choose_two`, `reason`, `motivations`) VALUES
(204, 'sitirokhaila@gmail.com', 'Administrasi Umum', 'Akademik', 'Karena saya tertarik dengan urusan administrasi dalam pembuatan proposal dan untuk mengembangkan minat bakat yang saya punya..', 'Ingin menambahh pengalaman, menambah relasi dengan yang lain. Menambah komunikasi dengan teman sekitar dan bertemu dengan orang orang motivator lainnya untuk mendapatkan pengetahuan diluar akademik dan untuk menambah informasi secara luas'),
(205, 'muhammadjody71@gmail.com', NULL, NULL, NULL, NULL),
(206, 'bettaagustina521@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Seni Budaya', '   Alasan saya ingin mengikuti Karena saya ingin sekali belajar luas ,dapat bisa melakukan dan mengamalkannya . ', '   Alasan saya ingin sekali mengikuti BEM ini adalah karena saya ingin merangkul kawan-kawan ,kakak-kakak dan adik-adik untuk terus memajukan kegiatan BEM ini agar lebih bisa membantu kedepannya untuk keperluan yg akan dibutuhkan jauh hari. '),
(207, 'aryop037@gmail.com', 'Pengabdian Masyarakat', 'Pengembangan Sumber Daya Manusia', 'pengabdian masyarakat:  \r\nmampu berkontribusi kepada masyarakat secara langsung serta bisa melatih kemampuan dalam berkomunikasi. \r\n\r\npengembangan sumber daya manusia:\r\ntertarik untuk belajar untuk mengedepankan hak-hak kelompok agar tercipta keharmonisan dalam organisasi serta ikut berkontribusi dalam pembinaan terhadap mahasiswa baru sehingga nilai-nilai yang di berikan dapat dimaknai.', '   melatih kerjasama tim serta mampu berfikir kritis dalam melakukan berbagai kegiatan keanggotaan dan menjadi mahasiswa yang lebih produktiif dan juga mampu mendengarkan aspirasi dari setiap anggota  '),
(208, 'fianseptian10@gmail.com', NULL, NULL, NULL, NULL),
(209, 'mtachyulqramadhani23@gmail.com', 'Olahraga', 'Pengabdian Masyarakat', 'Mengembangkan rasa kepeduliaan terhadap sesama serta meningkatkan jiwa kemanusiaan yang ada di lingkungan dan masyarakat sekitar dan juga berminat dalam bidang olahraga serta memiliki ketertarikan tentang semua hal dalam bidang ini.  ', 'Menambah pengalaman dalam berorganisasi serta membangun relasi menambah banyak pertemanan yang dapat menginspirasi, memiliki kegiatan yang bermanfaat dan melatih diri dalam bekerja sama untuk mencapai tujuan.  '),
(210, 'fachrezihamann@gmail.com', 'Seni Budaya', 'Olahraga', '  Ingin Mengembangkan kreativitas dan bakat mahasiswa di bidang seni dan olahraga', '  Karna saya ingin mengetahui kemampuan diri, menambah relasi, dan menambah wawasan dalam berorganisasi'),
(211, 'bayuwisnu376@gmail.com', 'Seni Budaya', 'Olahraga', ' Ingin mengembangkan minat dan bakat mahasiswa dalam bidang seni dan olahraga ', ' Ingin menambah relasi, memperluas wawasan tentang berorganisasi, mengasah kemampuan diri '),
