(213, 'nrndraryak@gmail.com', 'Penelitian dan Pengembangan', 'Olahraga', '   Alasan memilih Penelitian dan Pengembangan karena ingin mencoba belajar untuk mengontrol dan mengembangkan program kerja yang ada dan alasan untuk memilih Olahraga karena di waktu SMA pernah menjadi pelaksana kegiatan olahraga yaitu SMABICUP dan ingin mencoba mengembangkan lagi di bidang tersebut  ', '    Ingin belajar lebih tentang berorganisasi, memanage waktu, melatih publick speaking dan mencari relasi  '),
(214, 'raisazka01@gmail.com', 'Hubungan Masyarakat', 'Penelitian dan Pengembangan', 'Alasan saya memilih departemen Hubungan Masyarakat karena saya ingin meningkatkan jiwa sosialisasi yang ada pada diri saya serta menambah relasi. Sedangkan alasan saya memilih departemen Penelitian dan Pengembangan karena saya ingin mencoba untuk lebih peka terhadap lingkungan sekitar dan juga dapat berpikir kritis dalam menyelesaikan suatu masalah.', 'Alasan saya mengikuti BEM karena ingin keluar dari zona nyaman saya dimana saya tidak percaya diri dan takut untuk mengutarakan opini. Oleh karena itu, saya ingin belajar dari kakak-kakak BEM bagaimana caranya untuk lebih percaya diri dan dapat mengutarakan opini. Saya juga ingin menambah pengalaman serta wawasan melalui BEM ini.'),
