(218, 'uswaqilla04@gmail.com', 'Olahraga', 'Olahraga', ' Alasan saya memilih olahraga lebih menyukai dan aktif dalam bidang olahraga terutama basket dan Bulu tangkis, untuk basket saya pernah masuk  eskul pada saat SMK dan bulu tangkis  / badminton hanya iseng saja dikala gabut. ', '  Alasan saya mengikuti BEM agar saya bisa memahami apa itu organisasi dalam kampus , bisa mengendalikan diri saya sendiri untuk aktif, mengenal lingkungan baru dan bisa berkenalan dan akrab dengan orang-orang banyak  , bisa merasakan kerja sama tim dalam organisasi dan membangun rasa percaya diri saya untuk public speaking apalagi untuk didepan umum. '),
