(220, 'rizkyramdhani181@gmail.com', 'Olahraga', 'Pengembangan Sumber Daya Manusia', ' 1.)Departemen Olahraga \r\nmenurut saya mahasiswa dan mahasiswi Universitas Gunadarma memiliki banyak potensi yang harus dikembangkan hal tersebut menjadi perhatian saya untuk lebih mengembangkan dan meningkatkan bakat yang dimiliki oleh mahasiswa dan mahasiswi Universitas Gunadarma dan saya minat dalam bidang olahraga kemudian saya juga memiliki banyak ketertarikan tentang semua hal yang berkaitan dalam bidang ini.\r\n2.)Departemen Pengembangan Sumber Daya Manusia\r\nSebuah organisasi akan berkembang dengan baik apabila didukung oleh sumber daya yang baik pula dalam hal ini saya ingin belajar mengambil peran dan tanggung jawab untuk menggali,mengoptimalkan dan membina sumber daya manusia yang ada di Universitas Gunadarma \r\n\r\n ', ' 1.)Dengan keikutsertaan saya mengikuti BEM saya ingin menemukan lebih banyak relasi,teman ataupun jaringan baik dalam lingkungan internal maupun eksternal,\r\n2.)Saya juga ingin lebih mengoptimalkan waktu selama kuliah dengan mengisi kegiatan yang bermanfaat baik untuk saya pribadi maupun untuk orang lain \r\n3.)Saya ingin belajar mendapatkan pengalaman dan wawasan baru melalui kegiatan atau event yang ada pada BEM  '),
