(224, 'vionitadisty@gmail.com', 'Pengabdian Masyarakat', 'Pengembangan Sumber Daya Manusia', 'Pengabdian Masyarakat: Saya berharap dengan bergabung dengan biro ini dapat ikut serta dalam kegiatan sosial yang dapat menyebarkan banyak manfaat kepada orang lain. Selain itu, sebagai manusia saya ingin meningkatkan rasa kepeduliaan saya terhadap masyarakat sekitar.\r\n\r\nPengembangan Sumber Daya Manusia: Dengan bergabungnya saya dengan biro ini saya ingin membantu meningkatkan kinerja pengurus dan menciptakan lingkungan kerja yang positif dan profesional bagi BEM FIKTI UG.', 'Dengan bergabung di BEM FIKTI UG, saya ingin menambah pengalaman dan juga meningkatkan softskill, terutama dalam hal public speaking. Selain itu, sebagai seorang mahasiswa, saya akan memberikan kontribusi melalui ilmu dan pengalaman yang saat ini sudah saya miliki.'),
(225, 'ajeng.ariesti104@gmail.com', 'Pengabdian Masyarakat', 'Pengembangan Sumber Daya Manusia', ' Pengabdian Masyarakat: Dengan memilih departemen ini saya berkeinginan untuk menjadi orang yang lebih bertanggung jawab dalam lingkup suatu departemen dan juga saya ingin menjadi orang yang bermanfaat serta memiliki rasa empati tinggi di dalam suatu lingkungan.  \r\n \r\nPengembangan Sumber Daya Manusia: Saya ingin meningkatkan kreatifitas serta kinerja diri di dalam suatu departemen atau kelompok dan membantu memecahkan suatu masalah dengan adil dan bijak. ', '  Saya ingin memperluas relasi dan juga meningkatkan kemampuan diri untuk bersosialisasi sekaligus menambah pengalaman saya dengan bergabung dalam BEM ini. '),
(227, 'channelnam7@gmail.com', 'Pengembangan Teknologi Informasi', 'Politik dan Kesejahteraan Mahasiswa', '  Alasan saya memilih PTI karena saya ingin mengasah skill di bidang tekhnologi informasi yg telah saya pelajari di kelas.\r\nAlasan saya memilih Politik dan kesejahteraan mahasiswa karena saya suka Public speaking dan mengasah kepercayaan diri saya, merasa tertentang berbicara di depan orng banyak', '  Alasan saya mengikuti BEM ingin menambah pengalaman berorganisasi lebih dalam lagi dan ingin ikut serta didalam kemajuan kampus. '),
(228, 'topikoxide@gmail.com', NULL, NULL, NULL, NULL),
(229, 'thansevan@gmail.com', 'Pengembangan Teknologi Informasi', 'Bisnis dan Kemitraan', '  Pertama Saya Memilih Pengembangan Teknologi Informasi, karna saya ingin sekalian mengembangkan pengetahuan saya yang sekarang dengan cara masuk divisi PTI dalam BEM. lalu yang Kedua saya memilih BisMit karna saya ingin mengembangkan kemampuan softskill saya dengan melakukan penjualan barang berupa merchandise dan sebagainya, serta menjalin kemitraan dengan pihak-pihak eksternal untuk mensinergikan program kerja BEM FIKTI UG.', '  Saya Mengikuti BEM untuk Mendapatkan Pengalaman Dan mengasah softskill saya disana. dan juga menjadi bagian keluarga BEM FIKTI untuk mendapat relasi antar sesama disana'),
(230, 'suralagakemal@gmail.com', 'Olahraga', 'Seni Budaya', '  Karena saya lebih berfokus ke bidang olahraga dan saya mempunyai pengalaman dalam mengikuti lomba di cabang olahraga.', '  Alasannya ingin mengembangkan hardskill/softskill didalam diri saya, ingin menjadi pribadi yang terorganisir, ingin memperluas relasi, dan ingin mempunyai kontrubusi didalam BEM.'),
(231, 'hafidzurrahmans@gmail.com', NULL, NULL, NULL, NULL),
(232, 'fiomfarisi@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Olahraga', '  Alasan saya memilih pengembangan sumber daya manusia karena saya sering mengamati perkembangan diri dan juga orang disekitar menjadi leih baik. Sedangkan untuk biro olahraga karena alasan yang sederhana, saya suka ber olahraga', '  Ingin mengembangkan kemampuan berorganisasi, berkomunikasi, dan besosialisasi untuk meningkatkan kemampuan berinteraksi dan memperluas koneksi'),
(233, 'aryadwitama2@gmail.com', 'Olahraga', 'Seni Budaya', '   karena saya menyukai dan aktif di beberapa bidang olahraga seperti Futsal dan Badminton saat SMA. dan saya juga menyukai olahraga e-sport mobile legends karena sering memainkannya. ', '  Alasan saya mengikuti BEM supaya saya bisa memacu diri saya sendiri untuk aktif, mengenal lingkungan baru, memperbanyak relasi pertemanan, serta membangun rasa kepercayaan diri sendiri jika berbicara didepan umum. '),
(234, 'syafadania910@gmail.com', 'Pengabdian Masyarakat', 'Olahraga', ' Alasan memilih departemen pengabdian masyarakat karena ingin mengabdi kepada masyarakat serta mendengarkan aspirasi masyarakat dan membantu masyarakat sekitar agar terjalinnya keharmonisan antara mahasiswa dan masyarakat. Alasan memilih departemen olahraga karena ingin berkontribusi dalam mengembangkan minat dan bakat mahasiswa. ', ' Alasan mengikuti bem karena ingin melatih public speaking, memperluas networking dan mengembangkan skill yang tentunya bisa menunjang saya untuk berkarir setelah menyelesaikan perkuliahan.'),
(235, 'jafarnurizkimosary@gmail.com', NULL, NULL, NULL, NULL),
(236, 'wandaneaaa@gmail.com', 'Seni Budaya', 'Olahraga', '    karena hal yang berbau seni merupakan passion saya, dan saya ingin lebih mengembangkan lagi passion saya.  ', '    mengembangkan minat dan bakat saya terutama dalam bidang seni, menambah koneksi, belajar berorganisasi.  '),
(237, 'zulwidia1510@gmail.com', 'Administrasi Umum', 'Seni Budaya', 'Alasan saya memilih Administrasi Umum karena yang pertama, saya mengetahui seorang staff administrasi tentunya harus mempunyai karakter yang cekatan, teliti, dan detail. Hal tersebut memanggil saya untuk menjadi bagian di dalamnya, karena saya merasa memiliki karakter dan kemampuan yang sesuai untuk posisi seorang staff administrasi. Oleh sebab itu, saya merasa cocok menjadi bagian bidang ini dan yakin dapat menjalankan tugas Administrasi Umum dengan baik.\r\n\r\nKemudian alasan saya memilih departemen seni budaya karena pada dasarnya saya menyukai hal yang bersangkutan dengan seni terutama musik. Dan saya rasa banyak mahasiswa FIKTI yang juga tertarik dengan hal tersebut, saya tertarik untuk bisa membantu mereka mengembangkan minat atau bahkan bakatnya melalui departemen ini.  ', ' Alasan saya mengikuti BEM karena tentunya saya ingin meningkatkan kemampuan dan keterampilan bersosialisasi maupun komunikasi, dan juga problem solving yang akan sangat berguna kedepannya. Selain alasan utama tersebut, saya juga sangat ingin berkontribusi dalam membantu pengembangan kualitas maupun potensi mahasiswa FIKTI melalui BEM. Dengan dapat bekerja sama dengan tim pengurus BEM lainnya, hal tersebut tentunya juga dapat membantu menambah wawasan dan pengalaman saya. '),
(238, 'aldilabcd@gmail.com', 'Media', 'Pengabdian Masyarakat', ' pilihan 1 : karena di dalam media saya dapat menyampaikan apa yang saya rasakan terutama dibidang fotografi\r\npilihan 2 : karena saya senang bersosialisasi dan ingin tahu terhadap kehidupan masyarakat. ', '    ingin menambah pengalaman berorganisasi dilingkup kampus.  '),
(239, 'wahyukee1414@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Penelitian dan Pengembangan', '  Alasan Saya memilih Departemen ini karena saya ingin mencari pengalaman dan pengetahuan dalam memcahkan dan penyelesaian dari suatu hal atau masalah, lalu saya  bertujuan juga ingin menggali atau mengexplore potensi dalam berorganisasi pada departemen ini.', '  Alasan mengikuti BEM karena saya ingin memiliki pengalaman serta wawasan dalam berorganisasi, lalu saya ingin membangun hubungan dan relasi dalam pertemanan dan juga saya antusias dalam berkerja sama dalam tim.'),
(240, 'octavianasya@gmail.com', 'Olahraga', 'Pengabdian Masyarakat', '  Pada pilihan pertama saya yaitu Divisi Olahraga, saya sangat menyukai olahraga salah satunya adalah bulu tangkis, dimana saya juga pernah sekolah PBSI dan saya sempat ikut kepanitiaan acara yang diadakan oleh BEM FIKTI yaitu FOSC. Kemudian pada pilihan kedua saya yaitu divisi Pengabdian Masyarakat alasan utama saya adalah saya sangat ingin memberikan dampak positif bagi masyarakat, sebagai mahasiswa kita sudah selayaknya menebar hal yang positif bagi masyarakat, serta ingin meningkatkan softskill dalam berkomunikasi dengan masyarakat. Maka dari itu  saya merasa memiliki kompetensi yang sesuai sehingga saya merupakan kandidat yang tepat untuk posisi ini (olahraga/pengabdian masyarakat). Saya akan memberikan yang terbaik apabila bisa bergabung diposisi ini.  ', '  Saya ingin berkontribusi & memperbanyak relasi serta saya ingin tahu lebih dalam tentang BEM FIKTI agar bisa mendapat bekal & pengalaman yang cukup untuk kedepannya. Saya juga ingin mendapat banyak pengetahuan dan memperdalam organisasi untuk bisa siap terjun ke dunia kerja.  Saya akan Bekerja keras untuk mencapai target yang diinginkan dan akan memberikan yang terbaik untuk BEM FIKTI.  '),
(241, 'mhafidzazmy20@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Penelitian dan Pengembangan', 'Alasan saya memilih departemen ini karena saya suka divisi  karena divisi ini bertugas dan memiliki tujuan untuk mengembangakan,menggali dan mengoptimalkan potensi-potensi yang dimiliki pada setiap anggota', '  Alasan saya mengikuti organisasi karena saya ingin melatih jiwa kepemimpinan saya,melatih diri dalam bekerja sama untuk mencapai suatu tujuan dan juga ingin melatih kemampuan berbicara didepan umum'),
(242, 'anisrina73@gmail.com', 'Akademik', 'Seni Budaya', 'Alasan memilih departeman tersebut adalah untuk mendapatkan pengalaman tentang seminar dan kompetensi tingkat mahasiswa dan juga mengasah bakat saya dalam seni budaya', '  Alasan saya mengikuti BEM adalah agar mendapatkan pengalaman berorganisasi, menambah teman, dan memperluas wawasan '),
(243, 'edeliarum286@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Akademik', '       Alasan saya memilih Biro Pengengembangan Sumber Daya Manusia karna saya memiliki minat pada Biro ini untuk dapat membantu dalam mengembangkan sumber daya manusia dalam meningkatkan kinerja pengurus BEM baik secara internal maupun eksternal. Dan juga saya ingin belajar aktif untuk menciptakan hubungan baik dan harmonis antar pengurus BEM FIKTI UG, dengan menjadi pribadi yang peka terhadap sekitar. \r\n\r\n    Alasan saya memilih departemen Akademik sebagai pilihan yang kedua yaitu karena saya ingin lebih mengasah dan menambah kemampuan saya dalam berbicara dan  berkomunikasi baik itu secara personal, kelompok, maupun dihadapan banyak orang. selain itu saya juga ingin meningkatkan kemampuan lainnya untuk menambah pengalaman saya.\r\n ', '       Alasan saya mengikuti bem adalah karena keinginan saya untuk aktif dalam belajar berorganisasi, menambah wawasan dan pengalaman saya, saya ingin belajar bekerja sama dalam Tim dengan baik dan benar. Dan juga saya ingin memperluas relasi baik dalam lingkungan internal maupun eksternal organisasi. Selain itu juga agar saya dapat mempelajari hal hal baru yang belum pernah saya dapatkan sebelumnya.  '),
