(246, 'dewiiastha@gmail.com', 'Seni Budaya', 'Olahraga', '  Alasan saya memilih departemen Seni Budaya, karena ingin menambah wawasan dan ilmu lebih luas di bidang seni, dan juga ada ketertarikan dalam diri mengenai seni.', '  Alasan saya mengikuti BEM, karena ingin mengembangkan diri, skill, dan hobi. Saya juga ingin melatih diri dalam komunikasi dan kerja sama tim. '),
