(249, 'zahrinabilaaa@gmail.com', 'Pengabdian Masyarakat', 'Pengembangan Sumber Daya Manusia', 'Pengabdian Masyarakat :\r\nSaya sangat tertarik dengan kegiatan yang berhubungan dengan sosial masyarakat. tentunya dalam hal ini, saya mendaftarkan diri saya dan memilih pada Departemen Pengabdian Masyarakat, karena saya ingin membagi dan mengarahkan segenap waktu, pikiran, dan tenaga saya untuk kegiatan dalam ranah sosial. Karena setiap kali berada di tengah - tengah masyarakat, kita akan belajar berbagai hal baru didalamnya. Memahami setiap kondisi yang mungkin berbeda - beda, mendapatkan kejutan tak terduga, dan melalui semua hal itu kita akan dituntun untuk selalu belajar dan terus berkembang. Dan alasan saya memilih departemen ini karena saya memiliki kepribadian yang peduli terhadap sekitar dan ceria, dimana kepribadian tersebut mencerminkan departemen ini.\r\n\r\nPengembangan Sumber Daya Manusia:\r\nSelain yang berhubungan dengan sosial, saya tertarik juga untuk memilih Departemen Pengembangan Sumber Daya Manusia, karena saya ingin \r\nberkontribusi untuk mengembangkan kemampuan mahasiswa, meningkatkan strategi kaderasi, yang bertujuan untuk memberikan warna baru kepada para mahasiswa/i agar terjalin rasa kekeluargaan. Setiap kali diadakan program PSDM ini seperti adanya acara minat bakat yang dimana dengan telaksananya acara tersebut timbul rasa kekeluargaan antar mahasiwa dengan mahasiswa yang lain, mungkin ada yang bisa mengikuti acara tersebut tanpa ada masalah dan ada yang mendapatkan masalah, dan dari hal tersebut kita dapat belajar dan mengatasi dalam rasa kekeluargaan. Dan alasan saya memilih departemen ini karena saya memiliki kepribadian yang ceria dan peduli, dimana kepribadian tersebut mencerminkan departemen ini.\r\n  ', 'Saya sangat tertarik untuk bergabung dalam organisasi ( BEM ) ini, Karena menurut saya BEM merupakan suatu tempat yang baru, suatu organisasi yang mempunyai wadah/tempat untuk mencari wawasan/pengalaman yang lebih luas, di dalam organisasi ini saya dapat mengenal dan mendapat banyak relasi, dan juga saya dapat meningkatkan softskill diri saya seperti komunikasi depan umum, menganalisis dan berpikir kritis dalam memecahkan masalah, kerjasama tim, dan lain-lain.  setiap kali saya ada di dalam ruanglingkup organisasi, saya senang karena saya akan mengenal/belajar hal baru yang belum pernah saya temui, yang dimana akan bermanfaat untuk saya kedepanya. Saya yakin jika saya bergabung dalam organisasi ini saya akan bertanggung jawab mengemban amanah dengan baik.'),
(250, 'citraandhini23@gmail.com', 'Administrasi Umum', 'Seni Budaya', ' alasan saya memilih biro administrasi umum sebagai pilihan pertama, dikarenakan menurut saya ini bisa menambah skill saya di bidang administrasi tidak hanya itu menurut saya administrasi juga mengajarkan saya bagaimana menjadi sosok yang lebih teliti terhadap tugas yang diberikan dan juga bisa memperluas wawasan serta relasi yang saya bangun dengan pihak lain.\r\n\r\nserta mengapa saya memilih biro seni budaya sebagai pilihan kedua saya, yaitu seni dapat mengembangkan kekreativitasan saya dalam menyalurkan bakat maupun inspirasi yang berasal dari imajinasi saya. Selain itu menurut saya seni juga dapat menghubungkan saya dengan orang orang disekitar karena seni itu sejenis platform yang menurut saya dapat digunakan untuk berkomunikasi juga.', '   alasan saya mengikuti organisasi BEM yaitu saya ingin menambah relasi serta mengasah softskill saya dalam berorganisasi. \r\nKarena BEM ini merupakan organisasi formal di dunia perkuliahan, karena itulah saya ingin membuka diri agar memperluas wawasan serta bagaimana berkomunikasi dan menjalankan organisasi ini dengan baik.'),
(251, 'muhamadirgi42@gmail.com', '--Pilih Departemen / Biro--', '--Pilih Departemen / Biro--', '  ', '  '),
(252, 'primadhiaz@gmail.com', 'Akademik', 'Media', '   Kedua departemen tersebut merupakan passion yang saya miliki. Selain itu kedua departemen ini memiliki peran penting untuk kemajuan BEM FIKTI UG yang dimana saya ingin berkontribusi dan medalami bidang tersebut. ', '   Dengan loyalitas dan kemampuan yang saya miliki. Saya berharap saya berkuliah di gundar tidak hanya untuk menuntut ilmu saja namun menjadi wadah dalam pengembangan diri saya dalam berorganisasi dan meningkatkan softskill yang berguna di masa yang akan datang dan menurut saya menjadi anggota BEM merupakan wadah yang sangat cocok.'),
(253, 'andrihasballah1@gmail.com', NULL, NULL, NULL, NULL),
(254, 'dytaafadyajamal@gmail.com', 'Olahraga', 'Media', '   Alasan pertama memilih olahraga karena suka aja sama olahraga di bidang bulu tangkis, walaupun ga ahli \r\nAlasan kedua memilih kesenian bagian gambar karena suka menggambar tapi ga terlalu bagus. ', '  Nambah pengalaman, menambah banyak  skill Semacem komunikasi, manajemen waktu, bertukar pendapat, menambah wawasan, bekerjasama, memiliki lingkungan positif, dan lebih banyak lagi. Memperluas jaringan, menambah pengetahuan   '),
(255, 'rizkymfauzy@gmail.com', NULL, NULL, NULL, NULL),
(256, 'arfitafebriani87@gmail.com', 'Administrasi Umum', 'Akademik', 'Untuk memiliki kemampuan dalam menulis dan mencatat memerlukan sarana dan wadah yang baik oleh karena itu saya ingin mempelajari kegiatan administrasi dalam lingkungan organisasi agar minat dan bakat saya berkembang dengan baik.', 'Ingin mengasah softskill dan ikut berpartisipasi dalam menyusun kegiatan yang diselenggarakan oleh BEM FIKTI serta memperluas relasi. '),
(257, 'ramdhandwidana22@gmail.com', 'Pengabdian Masyarakat', 'Olahraga', ' Alasan saya memilih divisi Pengabdian Masyarakat adalahi hasrat saya yang kuat untuk terjun langsung di itengah-tengah masyarakat sebagai agent of exchange dan juga ingin menambah rasa kepekaan dan kepedulian terhadap kondisi masyarakat di sekitarnya. Dan juga kenapa pilihian kedua saya divisi olahraga karena saya memiliki hobby berolahraga serta sangat tertarik di bidang olahraga dan juga ingin membantu mengembangkan kemampuan dan kreatifitas para mahasiswa sesuai dengan minat dan bakat dalam bidang kesenian dan olahraga dengan event event yang di buat.', 'Salah satu cara meningkatkan soft skill yaitu dengan mengikuti organisasi di kampus, hal inilah juga yang menjadi alasan ingin saya mengikuti BEM. Selain itu yang pastinya saya ingin memperluas relasi dan networking, menambah wawasan karena bertemu orang-orang yang telah memiliki lebih banyak pengalaman, serta ingin menambah nilai jual dalam Curriculum Vitae (CV).'),
(258, 'emaileskyelvaaa19@gmail.com', 'Seni Budaya', 'Pengembangan Sumber Daya Manusia', '  Karena saya tertarik akan biro tersebut, ingin membangun relasi di bidang seni budaya dan psdm dengan teman-teman dan kakak tingkat. ', 'Ingin belajar berorganisasi, membangun relasi, memanage waktu serta belajar mengemban tugas dengan teman - teman. '),
(259, 'artemisiapn@gmail.com', 'Olahraga', 'Pengabdian Masyarakat', '   karena menurut saya pribadi, saya memiliki cukup kemampuan dalam bidang olahraga, dan juga dapat peduli terhadap kondisi masyarakat sekitar, apalagi saat pandemi seperti ini ', '   alasan saya mengikut BEM adalah untuk mengasah public speaking, menambah ilmu, menambah relasi, dan juga menambah pengalaman tentunya'),
(260, 'ganifhafiansyah24@gmail.com', 'Olahraga', 'Seni Budaya', '  karena keduanya sangat banyak disukai oleh orang dan kedua biro tersebut memiliki hubungan yang menarik, sehingga saya memilih biro tersebut karena ingin menambah wawasan dan pengalaman yang berkaitan dengan kegiatan-kegiatan olahraga dan juga seni budaya.', '  ingin menambah pengalaman dalam organisasi kampus serta meningkatkan skill hard maupun soft, ingin menambah jaringan atau relasi pertemanan yang luas, dan ingin belajar manajemen diri dan waktu.'),
(261, 'fathiatia2843@gmail.com', 'Hubungan Masyarakat', 'Pengembangan Sumber Daya Manusia', '   Ingin menjadi mahasiswi yang berperan aktif dalam menjalin hubungan relasi, baik secara internal maupun eksternal terhadap seluruh mahasiswa/i Fikti UG. Dan ingin ikut serta dalam pengembangan atau segala kemajuan dari fakultas yang saya duduki. ', '   Ingin mengembangkan kualitas diri dengan mengikuti organisasi di BEM ini. Dan ingin terus memperbanyak pengalaman dalam giat aktif berorganisasi.  '),
(262, 'sariningsihputri@gmail.com', 'Olahraga', 'Pengembangan Sumber Daya Manusia', '     Alasan saya memilih Departemen Olahraga dikarenakan pengalaman saya menjadi bagian dari olimpiade gunadarma 2021 sehingga saya berkeinginnan lebih untuk terlibat dalam Departemen Olahraga untuk proses pengembangan potensi/bakat olahraga/E-sport yang dimiliki mahasiswa. Dan juga karena perkembangan E-sport yang sangat pesat sekarang ini menjadikan saya ingin berkontribusi untuk memberikan wadah dari bakat E-sport Mahasiswa/i Gunadarma.\r\n\r\nAlasan saya memilih Biro Pengembangan Sumber Daya Manusia adalah karena saya ingin mengembangkan potensi yang dimiliki masing-masing individu melalui kreatifitas yang dimilikinya, mengembangkan pemikiran terhadap penyelesaian dan menghadapi setiap masalah, memberikan pemahaman kepada orang lain agar memiliki kepekaan terhadap kondisi lingkunagan sekitar.\r\n     ', '       Alasan saya ingin mengikuti BEM karena adanya keinginan dalam diri saya untuk menjadi bagian dari BEM FIKTI dan berkontribusi/ikut andil didalamnya. Keberadaan saya di BEM akan saya pastikan untuk memberi banyak pengaruh untuk perkembangan BEM kedepannya selama saya menjabat nantinya. Dan juga untuk menambah relasi saya serta meningkatkan kemampuan diri dalam bersosialisasi. '),
(263, 'riyas.fahri15@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Penelitian dan Pengembangan', '   Karena departemen ini untuk menambah pengalaman\r\ndalam menyelesaikan masalah dan rasa kemanusiaan, serta membangun karakter yang peka terhadap lingkungan. ', '   Untuk menambah cv dan juga bersosialisasi dalam organisasi '),
(264, 'fatihsyawal2512@gmail.com', 'Media', 'Pengabdian Masyarakat', 'Karna saya suka dengan videography, menjadi kesenangan untuk saya bisa berada dalam bagian media BEM FIKTI', 'Ingin memberikan kontribusi kepada BEM FIKTI, mengasah soft skill saya, dan menambahkan value dalam CV saya'),
(265, 'dinaditanti26@gmail.com', 'Pengabdian Masyarakat', 'Administrasi Umum', 'karena saya suka merencanakan dan mengatur detail dari setiap hal yang saya lakukan, ingin bermanfaat dalam hal positif  untuk orang lain, ingin meningkatkan sifat kepedulian dan empati kepada masyarakat.', 'karena ingin belajar berorganisasi, belajar kepemimpinan, menambah pengalaman, mengisi waktu luang agar lebih produktif, menambah relasi, menambah wawasan, mengasah kemampuan berkomunikasi di depan umum.'),
(266, 'rifathanshari@gmail.com', 'Media', 'Pengembangan Sumber Daya Manusia', ' Saya memasuki Biro Media ataupun Biro Pengembangan Sumber Daya Manusia untuk menambah pengalaman saya dan juga sebagai batu loncatan saya, dengan saya masuk Biro Media ataupun Biro Pengembangan Sumber Daya Manusia saya harap bisa lebih  mengembangkan bakat saya. ', 'Mengikuti BEM bagi saya adalah pengalaman pertama saya berkecimpung di bidang organisasi formal, saya harap dengan bergabung nya saya di BEM Universitas Gunadarma bisa memberikan saya pelajaran dan pengalaman untuk terjun ke dunia kerja. '),
(267, 'dlolilazundy@gmail.com', 'Olahraga', 'Pengabdian Masyarakat', ' pilihan 1 :\r\nSaya memilih departemen olhar karena saya menyukai bidang tersebut yaitu olahraga. dan ingin mengajak mahasiswa dan mahasiswa untuk mengikuti ekstrakulikuler di bidang olahraga dan memberitahu pentingnya olahraga untuk kesehatan kita.\r\npilihan 2 :\r\nsaya memilih pengabdian masyarakat karena saya ingin mengetahui lebih, dalam mengabdi kepada masyarakat sekitar. ', '   Ingin mendapatkan pengalaman, menambah wawasan, relasi, belajar berkomunikasi dalam tim, meningkatkan softs kill juga. Dan juga belajar disiplin dalam membagi waktu. '),
(268, 'azizahahmad262@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Pengabdian Masyarakat', '   Alasan karena saya ingin mangasah kemampuan komunikasi , memperluas jaringan relasi , belajar hal baru dan menjadi pribadi yang sabar dan simpati. ', 'Alasan saya ingin mengikuti BEM untuk mengupgrade  soft skill seperti kemampuan meyelesaikan tanggung jawab, manajemen waktu, dan memperluas lingkup pertemanan. '),
(269, 'kavatsmara@gmail.com', 'Pengabdian Masyarakat', 'Hubungan Masyarakat', '    Alasan saya untuk memilih biro pengabdian masyarakat sebagai pilihan pertama karena saya ingin lebih tanggap lagi dengan isu-isu yang terjadi dimasyarakat secara langsung, dan lebih peduli kepada lingkungan sekitar sedangkan alasan saya untuk memilih biro Hubungan Masyarakat karena ingin memperluas relasi dan menambah pengalaman untuk berkomunikasi.', '    Alasan saya mengikuti BEM FIKTI ini untuk menambah wawasan dan pengetahuan saya dalam berorganisasi atau bersosialisasi, menambah pengalaman dalam kerjasama tim dan juga untuk meningkatkan rasa percaya diri saya.'),
(270, 'aldiarya2002@gmail.com', NULL, NULL, NULL, NULL),
(271, 'natalidila22@gmail.com', NULL, NULL, NULL, NULL),
(272, 'nellynerisaardiyah@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Pengabdian Masyarakat', ' karena kedua divisi tersebut menarik saya dalam rasa kemanusia, selain itu saya ingin lebih memahami karakter yang ada di lingkungan saya maupun diluar lingkungan saya. diantara kedua divisi tersebut saya ingin lebih meningkatkan lagi rasa kepedulian saya terhadap masyarakat dan saya ingin menjadi pribadi yang lebih baik lagi kedepannya. saya juga ingin menghargai apa itu arti perbedaan.  ', '  saya ingin mencoba hal baru dan juga saya ingin menambah wawasan saya. sebelumnya saya memang belum pernah ikut organisasi, dengan ini saya ingin lebih banyak mendapatkan ilmu dan pelajaran yang bermanfaat untuk kedepannya. didalam organisasi ini nanti akan bertemu dengan orang orang baru dan saling bertukar pikiran.'),
(273, 'Fernandasiregar1910@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Pengabdian Masyarakat', ' Alasan saya memilih Pengembangan Sumber Daya Manusia (PSDM) adalah saya tertarik dengan PSDM karena biro PSDM bergerak di bidang pengembangan antar pengurus melalui lingkungan kerja yang positif, menurut orang-orang disekitar saya, saya merupakan pribadi yang dapat membangun suasana menjadi seru dan termasuk orang yang mudah beradaptasi dengan lingkungan maka dari itu saya memilih PSDM, dan alasan yang paling utama saya memilih Biro PSDM karena saya suka memotivasi orang, suka menyebarkan hal-hal positif kepada orang lain. Karena dengan saya memotivasi orang lain saya juga menjadi termotivasi dan juga menjadi pribadi yang lebih berguna karena dapat bermanfaat bagi orang lain.\r\n\r\nKemudian alasan saya memilih Departemen Pengabdian Masyarakat adalah karena saya tertarik dengan hal-hal yang berbau sosial, saya sangat menyukai berinteraksi dengan orang baru atau lingkungan baru, saya juga sangat menyukai kegiatan yang bertujuan membantu masyarakat, karena ketika saya melakukan kegiatan yang bertujuan membantu masyarakat saya menjadi lebih bahagia, menjadi pribadi yang lebih bermanfaat karena bisa membantu orang lain dan saya ingin menambah pengalaman kegiatan sosial saya lebih banyak di Departemen Pengabdian Masyarakat ini. \r\n ', ' Alasan saya mengikuti BEM karena saya ingin BEM menjadi tempat atau wadah saya untuk berkembang menjadi lebih baik lagi, ingin menambah pengalaman, ingin menambah relasi, saya juga ingin meningkatkan kemampuan public speaking, meningkatkan kemampuan beradaptasi, ingin meningkatkan time management skill, melatih soft skill kepemimpinan, meningkatkan kerja sama tim dan juga dengan mengikuti BEM dapat menambah nilai plus pada CV. '),
(274, 'shalvn7@gmail.com', 'Seni Budaya', 'Pengabdian Masyarakat', ' alsasan saya memilih biro seni dan budaya pada pilihan pertama adalah karena pada dasarnya saya memiliki minat lebih terhadap dapartemen atau biro seni dan budaya selain itu saya juga ingin bantu mengembangkan minat dan bakat mahasiswa/i FIKTI dalam bidang seni dan budaya.\r\nlalu alasan saya memilih Pengabdian Masyarakat adalah selain saya tertarik dalam bidang sebi dan budaya saya juga tertarik dengan kehidupan masyarakat, yang dimana saya ingin berkontribusi lebih dalam membantu masyarakat melalui biro Pengabdian Masyarakat. \r\n', ' alasan saya mengikuti BEM adalah saya ingin menambah pengalaman serta belajar dalam beroganisasi, selain itu saya juga ingin menyalurkan bakat serta minat saya dalam  biro atau dapartemen yang saya pilih dan juga saya ingin lebih melatih hardskill serta softskill saya di bidang kepemimpinan serta public speaking.'),
