(279, 'andiendsy@gmail.com', 'Seni Budaya', 'Olahraga', ' Karena, ingin memajukan prestasi non akademik bagi Mahasiswa/i FIKTI serta menimbulkan rasa cinta terhadap Seni Budaya, Meningkatkan bakat olahraga yang dimiliki Mahasiswa/i FIKTI dan Mengisi waktu luang dengan kegiatan-kegiatan yang positif ', ' Karena, ingin menambah pengalaman baru seperti, kepemimpinan, komunikasi, merencanakan dan melaksanakan sebuah acara dan lain-lain. Meningkatkan pengetahuan dan wawasan yang saya miliki, Berlatih untuk membentuk dan menjadi tim yang baik, Meningkatkan rasa percaya diri saya serta berkomunikasi dengan baik, dan Mengasah kemampuan Time management '),
(280, 'nababan2805@gmail.com', 'Seni Budaya', 'Olahraga', '1. Saya memiliki minat dalam dunia seni terutama seni musik serta olahraga\r\n2. Saya ingin menjadi bagian dalam event-event yang diselenggarakan oleh Universitas Gunadarma terutama event dalam bidang seni maupun olahraga\r\n3. Seni dan Olahraga merupakan bidang yang saya minati dan segani, sehingga ketika saya bekerja sesuai dengan apa yang saya minati, saya akan bekerja dengan baik dalam departemen tersebut sehingga visi serta misi yang telah disusun dapat terlaksana dengan sempurna.', 'Pertama adalah pasti untuk menambah pengalaman berorganisasi saya, mengasah kemampuan saya agar lebih baik lagi dalam melakukan manajemen waktu serta bekerja sama sebagai sebuah tim yang memiliki visi misi yang sama. Kemudian untuk menambah relasi dengan teman-teman dan kakak kelas baik dari satu region maupun dengan region lain untuk saling belajar satu sama lain. '),
(281, 'asihwulandr@gmail.com', 'Hubungan Masyarakat', 'Administrasi Umum', '- Karena saya fast respon, maka dari itu saya sangat menghargai waktu, menghargai orang lain, dan tidak suka menunda-nunda segala sesuatu.\r\n- Ingin lebih percaya diri karena akan bertemu banyak pihak dari luar.\r\n- Sesuai dengan keinginan dan kemampuan saya.', '- Menambah pengalaman saya dalam berorganisasi sehingga saya bisa mengasah skill saya, seperti komunikasi, problem solving, manajemen waktu, manajemen emosi, kedewasaan, dan presentasi, team \r\n  work.\r\n- Menambah wawasan dan meluaskan relasi'),
(282, 'hamidah.wulantri24@gmail.com', NULL, NULL, NULL, NULL),
(283, 'wahyujatmiko122@gmail.com', 'Olahraga', '--Pilih Departemen / Biro--', '   Saya ingin membuat  wadah bagi mahasiswa/i untuk meningkatkan hobi atau bakat yang dimiliki dalam bidang olahraga menjadi sebuah prestasi dan mengisi waktu luang dengan kegiatan positif tersebut.Seperti, mengadakan latihan rutin, mengikuti kelombaan dan lain lain. ', '   Saya ingin menambah pengalaman,wawasan, meningkatkan softskill dan menambah relasi dalam berorganisasi tersebut.Karena sebelumnya saya tidak pernah mengikuti suatu organisasi,jadi mohon bantuannya kak.'),
(284, 'widyaticahya09@gmail.com', 'Pengabdian Masyarakat', 'Olahraga', 'Alasan saya memilih departemen Pengabdian Masyarakat, karena saya ingin berkontribusi dan berguna untuk kemajuan masyarakat tertentu.\r\n\r\nAlasan saya memilih departemen Olahraga, karena ingin menjadi salah satu bagian yang menciptakan wadah untuk menyalurkan prestasi, hobi, dan meningkatkan daya tarik kebugaran jasmani bagi mahasiswa. ', 'Alasan saya bergabung BEM, karena saya ingin berkontribusi dalam menjembatani antara pihak Mahasiswa dan pihak Kampus sehingga dapat menyalurkan aspirasi mahasiswa hingga memunculkan suatu sinergi antara kampus dengan mahasiswa dan menghasilkan penilaian baik dari masyarakat terhadap kampus. Secara pribadi saya ingin meningkatkan softskill, melatih untuk berpikir kritis atau kekuatan team work dalam memecahkan permasalahan.   '),
(285, 'adib.shodiq@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Olahraga', ' Karena saya rasa pemikiran dan kemampuan saya berada di departemen tersebut ', '  Saya mengikuti bem karena ingin menambah relasi,menambah wawasan saya,dan sebagai saranan mengimprovisasi diri'),
(286, 'nandaluthfyy@gmail.com', 'Pengabdian Masyarakat', 'Pengembangan Sumber Daya Manusia', '  Karena ingin bersosialisai dengan berbagai macam karakter seseorang. ', '  Agar dapat menambah relasi, pengalaman dan ilmu wawasan. '),
(287, 'Kepo19019011@gmail.com', NULL, NULL, NULL, NULL),
(288, 'mentaririzky25@gmail.com', 'Seni Budaya', 'Politik dan Kesejahteraan Mahasiswa', 'Alasan saya karna saya menyukai seni budaya, dan ingin lebih paham akan bidang tersebut. Dan karena saya ingin ikut serta dalam membangun kesejahteraan mahasiswa.', 'Alasan saya karna tertarik, dan ingin ikut serta dalam kegiatan di dalam bidang yang saya sukai. Dan untuk menambah ilmu berorganisasi saya.'),
(289, 'doctorindigo6@gmail.com', 'Bisnis dan Kemitraan', 'Hubungan Masyarakat', '  karena di biro yang saya pilih sesuai dengan minat bakat yang saya miliki', 'Untuk meningkatkan kemampuan interaksi dan komunikasi dengan anggota dan mengembangkan soft skill dan hard skill'),
(290, 'syahruln665@gmail.com', NULL, NULL, NULL, NULL),
(291, 'anastasyaarifah20@gmail.com', 'Hubungan Masyarakat', 'Pengabdian Masyarakat', 'karena saya ingin ikut  meredam dan mengatasi  opini positif dan negatif dari  mahasiswa tentang kampus maupun organisasi BEM menurut saya humas  berperan cukup penting untuk hal ini. selain itu humas juga wadah untuk menyalurkan agar terlaksana sebuah  kegiatan yang ada dikampus,baik berinteraksi dengan pengguna dunia maya maupun secara realita. Oleh karenanya kita harus memaksimalkan kerja citra dan karakter positif organisasi yang di kelola akan lebih bisa diterima publik.', '  untuk mendapatkan pengalaman yang lebih di bidang organisasi dibanding mahasiswa yang lain. Dengan banyaknya jam terbang membuat saya  bisa menambah banyak skill, seperti komunikasi, manajemen waktu, manajemen emosi, kedewasaan, bersosialisasi dan presentasi. Selain itu,saya juga ingi berkontribusi memajukan universitas gunadarma lewat event-event yang ada bahkan yang akan ada di BEM FIKTI . '),
(292, 'mochammadfadli35@gmail.com', NULL, NULL, NULL, NULL),
(293, 'asherleonardo60@gmail.com', NULL, NULL, NULL, NULL),
(294, 'sitialiya280@gmail.com', 'Administrasi Umum', 'Administrasi Umum', ' Mengasah kemampuan saya dalam bidang kesekretariatan, terutama dalam hal surat-menyurat dan mengelola data serta mengasah kemampuan saya untuk mengelola keuangan dalam suatu organisasi.  ', ' Menambah pengalaman dan relasi dalam bidang yang saya minati serta melatih soft skill seperti manajemen waktu, public speaking dan lainnya.'),
(295, 'aliyafatin22@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Administrasi Umum', 'Alasan saya memilih departemen atau biro tersebut karena saya tertarik untuk berkontribusi pada divisi tersebut dan saya ingin banyak belajar. \r\n\r\nAlasan pilihan pertama saya yaitu Pengembangan Sumber Daya Manusia karena saya ingin mengasah kemampuan berkomunikasi, ikut berperan aktif dalam bertanggung jawab mengatur, mengawasi, kinerja pengurus BEM fikti, serta menurut saya, diri saya sendiri termasuk orang yang peduli. Maka dari itu, saya merasa saya dapat untuk merangkul dan menjaga kekeluargaan antar pengurus BEM FIKTI UG.\r\n\r\nAlasan pilihan kedua saya yaitu Administrasi Umum karena ketika saya SMA saya sempat menjabat sebagai sekretaris di sebuah pengurus ekskul. Selain itu, tentunya saya ingin menambah wawasan saya di bidang Administrasi Umum ini, juga saya ingin mengetahui lebih hal dalam mengurus dan mengatur kesekretariatan di sebuah organisasi kampus. Saya merasa cocok dengan departemen ini karena menurut saya, diri saya adalah orang yang teliti.', ' Alasan saya mengikuti BEM adalah agar kemampuan berorganisasi saya dapat berkembang, untuk belajar hal-hal baru, menambah relasi, meningkatkan kemampuan diri, dan berkontribusi pada kegiatan organisasi di kampus.  '),
(296, 'irsanzh060101@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Pengembangan Sumber Daya Manusia', 'Orang yang ada dalam Biro PSDM memikul tanggung jawab yang sangat tinggi di dalam suatu organisasi. Bukan hanya sekedar mengembangkan kemampuan intelektual semata, namun ia juga masuk ke ranah sosial dan emosional seluruh anggota kelompok yang ada.', '- Belajar ber-organisasi\r\n- Meningkatkan Soft Skill terutama Teamwork\r\n- Menambah nilai jual dalam CV (Curriculum Vitae)'),
(297, 'fatkhurohman091@gmail.com', NULL, NULL, NULL, NULL),
(298, 'nauranqanita2002@gmail.com', 'Olahraga', 'Seni Budaya', '    Karena itu dua hal yang saya senang kerjakan  ', '    Saya ingin menambah pengalaman, relasi, sekaligus menambah hard skill/soft skill di bidang yang saya minati  '),
(299, 'septiyaninadiaaa@gmail.com', NULL, NULL, NULL, NULL),
(300, 'miselia411@gmail.com', 'Administrasi Umum', 'Akademik', 'Pertama, saya memilih Administrasi umum karena ingin bergabung menjadi anggota di bidang kesekretariatan. Setelah saya mengenali tugas-tugasnya yang berhubungan dengan penyusunan proposal, surat menyurat, atau pencatatan, saya merasa mampu bertanggung jawab dalam bidang tersebut.\r\n\r\nKedua, alasan saya memilih departemen akademik karena saya pernah bergabung dan melihat sendiri bagaimana implementasinya melalui kepanitian Technofair 8.0 lalu. Jika tidak salah, Technofair 8.0 adalah salah satu event besar Universitas Gunadarma yang di pantau oleh departemen akademik dengan tujuan emas yaitu mewadahi, meningkatkan, dan mengembangkan minat bakat mahasiswa/i FIKTI UG. ', 'Saya ingin menambah relasi, pengalaman dalam berorganisasi, meningkatkan kemampuan berkomunikasi, mengasah efisiensi waktu, serta mencoba hal baru. '),
(301, 'adrianrufy@gmail.com', 'Politik dan Kesejahteraan Mahasiswa', 'Hubungan Masyarakat', '  Menaruh departemen politik dan kesejahteraan mahasiswa di pertama karena saya ingin membantu menyalurkan aspirasi mahasiswa yang suaranya tidak terdengar, baik secara vertikal maupun horizontal untuk meminimalisir kemungkinan terjadinya konflik sosial maupun  konflik kepentingan di dalam BEM FIKTI atau di dalam FIKTI\r\n\r\n   Memilih Hubungan masyrakat karena saya ingin membantu BEM FIKTI untuk menjadi wadah penyalur informasi utama bagi rakyat FIKTI dan memastikan bahwa alur informasi diterima dari atas ke bawah dengan baik , juga membantu bem fikti membangun relasi dengan bem fakultas gunadarma lainnya. agar terjalinnya hubungan baik sesama BEM FIKTI, juga membangun komunikasi dua arah dengan komunitas eksternal di luar gundar supaya  terbentuknya eksistensi gunadarma di mata eksternal kampus', '   Alasan untuk bem : saya ingin mengikuti bem karena saya yakin bahwa diam dan hanya menyaksikan rekan rekan di BEM berjuang sendiri bukan suatu tindakan yang tepuji, saya mau ikut turut serta mengambil andil dalam proses membangun BEM FIKTI menjadi jauh Lebih baik, juga membantu rekan -rekan di BEM FIKTI mencetuskan inovasi dan terobosan baru yang positif kepada bem FIKTI \r\n\r\nAlasan untuk diri sendiri : saya ingin membuktikan ke diri saya sendiri bahwa saya bisa mengatasi segala tantangan yang tercipta atas keputusan saya sendiri. dengan harapan bahwa saya akan menjadi versi diri saya yang lebih baik\r\n'),
(302, 'hanifahshafiyatul@gmail.com', 'Administrasi Umum', 'Akademik', '   Menambah pengalaman dari biro yang saya pilih baik administrasi umum maupun akademik,  seperti menyusun proposal dan mengembangkan bidang akademis lainnya.', '   Melatih kepemimpinan,belajar agar lebih berpikir kritis,memperluas koneksi, belajar manajemen waktu. '),
(303, 'yogaaprianto50@gmail.com', 'Olahraga', 'Media', '  Saya memilih departemen ini  karena pada departemen sesuai dengan apa yang saya sukai dan jadi ada kemungkinan saya akan dapat lebih mudah berkontribusi di kedua departemen tersebut  ', '    Alasan utama saya mengikuti BEM ingin dapat memudahkan saya bersosialisasi dengan orang lain dan membangun relasi terhadap orang sekitar, dan juga membangun mental untuk melakukan pekerjaan individu ataupun kelompok.'),
(304, 'febrianaa2722@gmail.com', NULL, NULL, NULL, NULL),
(305, 'rgantari23@gmail.com', 'Pengabdian Masyarakat', 'Olahraga', 'karena saya ingin mendapatkan pengalaman akan sosial yang jauh lebih sesuai dengan yang di lapangan dan juga mewujudkan keinginan saya dalam berorganisasi', ' ingin mendapatkan banyak relasi dan banyak pengalaman yang diluar dari lingkungan sehari hari'),
(306, 'fazriz1501@gmail.com', 'Media', 'Media', '   Saya ingin bisa ikut serta dalam memperbaiki atau memperindah visualisasi media Bem Fikti. ', '   Pastinya membawa BEM FIKTI ke arah yang lebih baik menjadikan BEM fikti jadi wadah yang baik bagi mahasiswa nya. Serta bisa ikut adil dalam segala masalah yang ada dan bisa menyelesaikan nya dengan seksama. Saya juga ingin memperluas relasi yang baik. '),
(307, 'rayyanhasyimaljufri@gmail.com', NULL, NULL, NULL, NULL),
(308, 'natasyanat38@gmail.com', NULL, NULL, NULL, NULL),
(309, 'fitriana2015.fh@gmail.com', 'Media', 'Pengabdian Masyarakat', '  Karena saya memiliki ketertarikan dan juga pengalaman di bidang/biro tersebut.', '  Karena saya ingin menambah pengalaman, relasi dan juga jam terbang saya dalam mengikuti organisasi.'),
(310, 'navyazh172@gmail.com', NULL, NULL, NULL, NULL),
(311, 'annisamjjj@gmail.com', 'Media', 'Administrasi Umum', '   Alasan saya memilih departemen atau biro tersebut karena saya ingin menambah ilmu saya dibidang  media dan administrasi adalah dapat mengasah skill saya karenailmu administrasi juga akan kita rasakan atau kita bawa ke kehidupan sehari- hari. Di bidang media saya sangat suka mengeksplor sesuatu atau tempat  yang menurut saya sangat indah dan bisa lebih kreatif kedepannya seiring perkembangan zaman.', ' 1. Menambah Pengalaman di bidang organisasi\r\n2. Menambah relasi dan pertemanan\r\n3. Melatih diri untuk bekerja sama untuk mencapai tujuan \r\n4. Belajar untuk mengatur waktu '),
(312, 'afajarmulia@gmail.com', 'Hubungan Masyarakat', 'Akademik', ' Alasan saya memilih biro ini adalah saya merasa cocok dengan kerja dan benefit yang ditampilkan di deskripsi, saya juga memiliki pengalaman di bagian ini pada organisasi sekolah seperti surat menyurat, membuat proposal, menjalin komunikasi terhadap petinggi sekolah, pihak sponsor, dan berbagai pihak lainnya dalam melaksanakan acara tersebut, dan tentunya saya ingin belajar dan berusaha untuk mengembangkan diri saya dan biro yang saya pilih untuk kedepannya ', '   Alasan saya mengikuti BEM adalah untuk melanjutkan kegiatan organisasi saya dari sekolah, menambah pengalaman dan pengetahuan dalam berorganisasi, ingin meningkatkan skill saya baik itu soft skill maupun hard skill, ingin memperluas relasi apalagi saya merupakan anak rantau yang dimana sangat butuh yang namanya relasi dalam berteman dan bersosialisasi. ');
INSERT INTO `users_choose_point` (`id_point`, `email`, `choose_one`, `choose_two`, `reason`, `motivations`) VALUES
(313, 'rafif.irbah@gmail.com', 'Media', 'Olahraga', 'Karna lebih punya pengalaman di bidang olahraga dan media\r\n  ', '   Selama masuk kuliah terlalu leha leha sama nyantai jadi buat semester ini nyoba buat nyari pengalaman keorganisasian sama bisa berbaur sama orang orang yang ada pengalaman di bem, ngulik ilmunya dan bisa ngerasain apa itu rapat/meeting/presentasi  nanti biar nilai plus buat sidang skripsi biar ga kaku\r\nTerlebih buat cv yang terpenting\r\nIntinya biar di kuliah ini ga cuma dapet lulusnya aja\r\n\r\nSemoga saya bisa berguna buat bem fikti kalo saya keterima\r\n\r\n   '),
(314, 'vikonura@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Pengabdian Masyarakat', '  Ingin memberi manfaat kepada orang di sekitar maupun masyarakat, mengasah kemampuan berkomunikasi, mengasah kemampuan public speaking, memperluas relasi, menambah pengetahuan, mengembangkan sikap bertanggung jawab serta lebih mengetahui kondisi sosial masyarakat di masa kini.', '  Ingin menambah pengalaman, memperluas relasi, menambah pengetahuan serta mengembangkan diri dalam berorganisasi dan juga berpartisipasi dalam kegiatan kemahasiswaan Universitas Gunadarma.'),
(315, 'dianararahma@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Pengabdian Masyarakat', ' Alasan saya memilih divisi PSDM karena ingin berkontribusi untuk meningkatkan dan menciptakan pengurus pengurus yang handal dan kompeten, selain itu saya senang bertemu orang baru dan berkomunikasi dengan baik. Dan didukung oleh penaglaman saya mengikuti career preparation class (sebuah workshop 1-on-1) yang di hadiri langsung dengan para HR berpengalaman dari perusahaan BUMN Pertamina, Beberapa Start Up bidang Pendidikan dan Perusahaan Multinasional seperti Indosat.  Dan juga saya ingin mengembangkan skill dalam berkomunikasi dengan orang baru dan kerja sama tim\r\n\r\nAlasan saya memilih Pengabdian Masyarakat pada pilihan ke - 2 karena saya teringat pada 5 peran mahasiswa dalam bermasyarakat, yaitu salah satu nya sebagai agen sosial, maka dari itu dengan bergabung dalam BEM FIKTI Biro Pengabdian Masyarakat ini saya ingin merasakan manfaatnyaberbagi ilmu dan bermanfaat kepada orang lain sebagai seorang mahasiswa.\r\n ', ' -	Melatih skill terutama softskill maupun hard skill\r\n-	Mencari pengalaman baru karena semua pengalaman bisa kita dapatkan saat kuliah terutama di dalam organisasi\r\n-	Sebagai modal untuk melamar pekerjaan\r\n-	Menambah kenalan dan memperluas relasi\r\n-	Memanfaatkan waktu dengan baik\r\n-	Melatih rasa tanggung jawab\r\n '),
(316, 'nicoandriansah29@gmail.com', 'Olahraga', 'Pengembangan Teknologi Informasi', 'Yang pertama karena saya sangat menyukai olahraga. Dan yang kedua karena ingin mengasah dan mengembangkan pengetahuan dibidang Teknologi informasi dan komunikasi.', 'Karena saya ingin memperbanyak relasi, merasakan berorganisasi di perkuliahan, mendapatÄ·an segala ilmu pengetahuan, dan pengalaman dalam berorganisasi BEM. '),
(317, 'dagelan@dagelan.com', NULL, NULL, NULL, NULL),
(318, 'shintasasmitha@gmail.com', 'Penelitian dan Pengembangan', 'Pengembangan Sumber Daya Manusia', '  Saya ingin belajar mengasah analisis saya agar lebih kritis dan menjadikan kepribadian saya lebih aktif daripada sebelumnya. ', 'â€¢ Saya ingin meningkatkan kemampuan berorganisasi yang telah saya mulai dari SMA. \r\nâ€¢ Saya ingin mencoba untuk lebih berinteraksi dengan orang banyak untuk meningkatkan interaksi sosial saya dan juga berdampak untuk sekitar.'),
(319, 'nayakapratama99@gmail.com', NULL, NULL, NULL, NULL),
(320, 'wandykusumodianto123@gmail.com', 'Olahraga', 'Seni Budaya', '   untuk pilihan pertama memang saya sangat gemar olahraga terutama futsal dan tenis meja ,karena dengan berolahraga tubuh menjadi sehat dan tidak mudah sakit .\r\nuntuk pilihan kedua, sebagai warga indonesia kita harus bangga karena indonesia memiliki banyak ragam seni dan budaya yang dimana kita sebagai generasi muda harus terus melestarikan dan mempertahankan seni dan budaya yang sudah menjadi ciri has masing masing daerah di indonesia ', '   ingin menambah pengalaman baru dalam berorganisasi di kampus  '),
(321, 'muhammadfarhan1488@gmail.com', 'Pengembangan Teknologi Informasi', 'Politik dan Kesejahteraan Mahasiswa', 'Mendapatkan pengalaman yang baru, mendapatkan relasi, belajar untuk mengembangkan diri, ingin memperdalam ilmu di bidang teknologi dan politik. ', '  Agar bisa mendapatkan sesuatu yang bermanfaat dari mengikuti BEM dan juga pastinya menambah relasi ataupun menambah pengalaman berharga. '),
(322, 'ansells2003@gmail.com', 'Bisnis dan Kemitraan', 'Hubungan Masyarakat', '  kenapa saya memilih bisnis dan kemitraan untuk menjadi pilihan pertama saya . karena saya ingin mengetahui serta belajar lebih untuk mengetahui hal hal apa saja yang diperlukan dalam melakukan bisnis itu sendiri dan cara memanagenya , lalu kenapa saya memilih humas menjadi pilihan ke 2 saya karena saya juga ingin lebih berkomunikasi kepada orang banyak dan melatih soft skill saya dalam hal komunikasi .', '  kenapa saya mengikuti BEM ini , karena saya ingin berbaur dan menjalin silaturahmi kepada teman teman yang ada di gunadarma secara lebih dekat dan juga saya ingin mencoba ikut ke dalam organisasi organisasi supaya kedepannya saya tidak kaget menghadapi realita dunia ini.'),
(323, 'diahfitriana70@gmail.com', NULL, NULL, NULL, NULL),
(325, 'fair.servant@gmail.com', 'Hubungan Masyarakat', 'Pengembangan Sumber Daya Manusia', 'tertarik untuk membuat dan menjalin relasi terkait dalam hubungan masyarakat serta memonitoring tugas pengurus BEM supaya peka terhadap seitar', 'menambah wawasan, koneksi dan pengalaman baru'),
(326, 'sampard30@gmail.com', NULL, NULL, NULL, NULL),
(327, 'muhfarhanfeb@gmail.com', NULL, NULL, NULL, NULL),
(328, 'marsyafarras19@gmail.com', 'Penelitian dan Pengembangan', 'Pengembangan Sumber Daya Manusia', 'Untuk meningkatkan kualitas para pekerja atau manusia melalui program pendidikan dan pelatihan agar menciptakan sebuah produk yang berkualitas dan mampu memajukan perusahaan atau organisasi, dengan SDM (Sumber Daya Manusia) yang berkualitas dapat mengurangi tingkat kerusakan atau kecelakaan kerja. Jadi dengan adanya program pengembangan ini pekerja menjadi semakin terampil dan berkualitas.', 'Tujuan saya ikut BEM adalah untuk melatih diri mengenai kepemimpinan, melatih diri dalam bekerja sama untuk mencapai tujuan, melatih mental berhadapan dengan banyak orang, melatih kemampuan berbicara di hadapan orang banyak, memperluas jaring pertemanan atau network, memperluas ilmu pengetahuan, wawasan juga pengalaman.\r\n\r\n'),
(329, 'alrifqy16@gmail.com', NULL, NULL, NULL, NULL),
(330, 'derrel27@gmail.com', 'Hubungan Masyarakat', 'Pengembangan Sumber Daya Manusia', '   Alasan aku memilih dua divisi tersebut (Hubungan Masyarakat dan Pengembangan Sumber Daya Manusia) sebenarnya adalah aku melihat sebenarnya negara Indonesia ini cukup potensial sebagai negara yang bisa bersaing dengan negara lain, tetapi kualitas Sumber Daya Manusia masih kurang apabila dibandingkan dengan negara lain, selain itu sebagian masyarakat Indonesia mengalami degradasi moral selama masa pandemi, oleh karena itu alasan tersebut jadi alasan utama kenapa aku memilih departemen/biro tersebut. ', ' Alasan aku pengen mengikuti  BEM adalah aku ingin mengubah diriku, dari aku yang bukan siapa-siapa, menjadi seorang yang punya potensi lebih, dengan melatih kerjasama antar temen2 ku, dan melatih public speaking supaya aku bisa menjadi orang yang siap (got employeed) di masa depan apapun yang terjadi '),
(331, 'ariefpod@gmail.com', 'Pengembangan Teknologi Informasi', 'Seni Budaya', '  saya memilih departemen atau biro tersebut karena sesuai dengan apa yang sedang saya tekuni saat ini dan sesuai dengan apa yang saya minati dalam kehidupan saya ', '  saya ingin memperluas wawasan,memperbanyak relasi, serta menambah pengalaman baru di organisai yang kelak jika saya lulus seleksi dan menjadi anggota'),
(332, 'muhamadnovan18@gmail.com', 'Bisnis dan Kemitraan', 'Olahraga', '  karena saya sudah mempelajari bidang bisnis dan kemitraan dan bidang olahraga  ', '  saya ingin mempelajari dalam lagi di bidang bisnis atau kemitraan'),
(333, 'ikhsanusaly147@gmail.com', 'Pengembangan Teknologi Informasi', 'Olahraga', '  Alasan saya memilih biro PTI ialah karena passion saya di dunia Teknologi Informasi dan untuk pilihan 2, yaitu olahraga karena saya mempunyai kegemaran di dunia olahraga terutama sepakbola', '  Alasan mengikuti BEM ialah ingin menjadi pribadi yang lebih aktif dan juga ingin memperluas relasi saya.'),
(334, 'amelianhaliza@gmail.com', NULL, NULL, NULL, NULL),
(335, 'rifqiherjuno1@gmail.com', NULL, NULL, NULL, NULL),
(336, 'sintiatriapriani260403@gmail.com', NULL, NULL, NULL, NULL),
(337, 'ferrelwibowo71@gmail.com', NULL, NULL, NULL, NULL),
(338, 'nabilahakbar.in@gmail.com', 'Penelitian dan Pengembangan', 'Pengembangan Sumber Daya Manusia', '   Alasan saya memilih departemen tersebut karena saya suka menganalisis dan merencanakan suatu hal, agar menjadi lebih baik. Saya juga ingin belajar untuk bekerja sama secara team. Saya juga ingin menjadikan cara berpikir saya menjadi lebih rasional. Dan saya ingin menambah pengalaman saya. Terima kasih.', '   Alasan saya mengikuti BEM, yang pertama adalah untuk menambah wawasan serta pengetahuan yang sebelum belum saya tahu. Lalu, saya juga ingin menambah soft skill saya dengan baik. Selanjutnya saya juga ingin belajar bagaimana cara beroganisasi, saya ingin memperluas relasi serta networking yang saya miliki. Saya juga ingim menambah nilai jual dalam CV. Dan yang paling utama, saya ingin mengembangkan diri saya menjadi lebih baik lagi dalam segala aspek dan menambah pengalaman. Terima kasih.'),
(339, 'bayusulistyo1797@gmail.com', NULL, NULL, NULL, NULL),
(341, 'dinda2096@gmail.com', NULL, NULL, NULL, NULL),
(342, 'fiqirean@gmail.com', 'Pengabdian Masyarakat', 'Administrasi Umum', '  Karna saya senang dan semangat jika ada kegiatan sosial ataupun bertemu dengan masyarakat langsung. \r\nDan saya sedikit memahami mengenai administrasian ', '  Karna menurut saha Bem merupakan wadah aspirasi organisasi untuk mahasiswa dapat berkembang sesuai dengan apa yang mereka minati '),
