(347, 'annisa.mahartika@gmail.com', 'Hubungan Masyarakat', 'Administrasi Umum', '  saya telah menguasai tugas dan berpengalaman di divisi tersebut. divisi ini sesuai dengan karakter dan kemampuan saya.', '  ingin belajar berorganisasi pada tingkat mahasiswa, meningkatkan soft skill dan ingin menambah wawasan'),
(348, 'bayu200152@gmail.com', NULL, NULL, NULL, NULL),
(349, 'bintangabikara@gmail.com', 'Pengabdian Masyarakat', 'Pengembangan Sumber Daya Manusia', '    Karena ingin lebih banyak interaksi dan aktivitas yang berhubungan dengan masyarakat atau yang berubungan dengan orang banyak.  ', '    Untuk meningkatkan soft skill, menambah wawasan, meluaskan relasi, dan menambahkan nilai-nilai dalam CV.  '),
(350, 'rmbagaskarads@gmail.com', NULL, NULL, NULL, NULL),
(351, 'intanzakiyyah24@gmail.com', 'Pengembangan Sumber Daya Manusia', 'Penelitian dan Pengembangan', '  Dari deskripsi yang saya baca, bisa melatih kemampuan problem solving.', 'Ingin mengeksplor dunia organisasi lebih dan menambah banyak teman.'),
(352, 'laela.isnaeny@gmail.com', 'Pengabdian Masyarakat', 'Pengabdian Masyarakat', '  Alasan saya memilih PengMas karena saya ingin berkontribusi dalam pengabdian masyarakat dengan jiwa sosial saya yang tinggi. Besar harapan saya dapat merealisasikan proker - proker di PengMas dengan membawa nama baik universitas gunadarma.', '  Alasan saya mengikuti BEM karena selain menambah relasi, BEM menjadi wadah saya dalam meningkatkan softskill serta menjadi wadah saya untuk berkontribusi lebih di fakultas. Dengan adanya saya di BEM FIKTI saya yakin saya dapat berkembang bersama BEM FIKTI.'),
(353, 'ilhamardhiansyah.ia350@gmail.com', 'Penelitian dan Pengembangan', 'Administrasi Umum', '  sangat sesuai dengan pasion saya dan saya ingin belajar dan mengembangkan nya lebih lagi', '  ingin menambah wawasan dan pengalaman serta dapat menyaluran bakar saya'),
(354, 'araaswid2@gmail.com', NULL, NULL, NULL, NULL),
(355, 'satya.danutama69@gmail.com', 'Olahraga', 'Pengembangan Sumber Daya Manusia', '  Karena saya ingin tahu bagaimana atau apa saja yang dilakukan pada departemen dan biro tersebut.', '  ingin mencoba  ber-organisasi di dalam kampus dan menambah pengalaman serta relasi.');
